(1, 'Gallery shooting', 'Frank Castle', '1654981162', '', '[{\"type\":\"casing\",\"id\":\"6784\",\"identifier\":\"67-KDQ-155\",\"description\":\"Gun casing found on scene \",\"cid\":\"67\"},{\"type\":\"casing\",\"id\":\"8325\",\"identifier\":\"78-FUL-271\",\"description\":\"Gun casing found on scene \",\"cid\":\"67\"},{\"type\":\"casing\",\"id\":\"3619\",\"identifier\":\"3-qjj-87\",\"description\":\"Bullet casing from scene\",\"cid\":\"3\"},{\"type\":\"casing\",\"id\":\"9271\",\"identifier\":\"16-trb-70\",\"description\":\"Bullet casing from scene\",\"cid\":\"3\"},{\"type\":\"casing\",\"id\":\"7945\",\"identifier\":\"51-oFb-583\",\"description\":\"Bullet casing from scene\",\"cid\":\"3\"},{\"type\":\"casing\",\"id\":\"3246\",\"identifier\":\"40-PSy-57\",\"description\":\"Bullet casing found on scene \",\"cid\":\"40\"}]', 'null', 'null', NULL, NULL, NULL),
(2, 'Anthony Johnson - Assault on LEO', 'Alex Hernandez', '1654981553', '**LSPD Report**\n\n2022-06-22\n\n**Reporting Officer:**\n\n@Alex Hernandez\n\n**Assisting Officers:**\n\n@Jimmy Jones @Anthony Johnson\n\n**Location:**\n\nAlta Street Apartments\n\n**Debrief:**\n\n\\\n**@101 Alex Hernandez Statement:**\n\n> @101 was patrolling when we noticed a parked vehicle on the sidewalk. 101 turned on his lights and stepped out of the vehicle with Ranger Sergeant Jimmy Jones. 101 told the suspect Anthony Johnson that hes currently parked on a sidewalk and needs to move and park somewhere else. The suspect was very aggressive and stepped out of his vehicle and began to assault Officers. During the interaction Jimmy Jones was knocked out and 101 took down the suspect with his hands. The suspect was placed into custody, picture of scene was taken and both Officer and suspect were transported to Pillbox for medical. Suspects rights were read and was then transported to MRPD, got a mugshot and processed to be sent to Boiling Broke.\n\n\\\n', '[{\"cid\":\"89\",\"identifier\":\"https://i.imgur.com/MTexFXh.jpeg\",\"description\":\"Stolen Vehicle Used 1/1\",\"type\":\"photo\",\"id\":\"8749\"},{\"cid\":\"89\",\"identifier\":\"DNA - 89\",\"description\":\"Anthony Johnson\",\"type\":\"blood\",\"id\":\"8915\"}]', '[{\"cid\":9,\"name\":\"Jimmy Espinoza\",\"callsign\":\"104\"},{\"cid\":16,\"name\":\"Alex Hernandez\",\"callsign\":\"101\"},{\"cid\":87,\"name\":\"Anthony King\",\"callsign\":\"121\"}]', '[{\"cid\":89,\"name\":\"Anthony Johnson\"}]', NULL, NULL, '[{\"cid\":89,\"warrantdate\":0,\"processed\":true,\"name\":\"Anthony Johnson\",\"warrant\":false,\"charges\":[{\"title\":\"Assault On Public Servant\",\"id\":\"6237\",\"months\":10,\"fine\":1250,\"points\":0}],\"months\":10,\"fine\":1250,\"points\":0,\"guilty\":true}]'),
(3, 'Jerome Steppa - Assualt with a deadly', 'Johnthan Bean', '1654985239', '**LSPD Report**\n\n2022-06-22\n\n**Reporting Officer:**\n\n@160 J.Bean\n\n**Assisting Officers:**\n\n@103, @122, @512\n\n**Location:**\n\nBennys at Power Street and Power Street Construction\n\n**Debrief:**\n\n\\\n**@160 J.Bean Statement:**\n\n> @160 was patrolling when units received a downed individual call at the Bennys on Power St. (10-47) @160 responded and noticed 2 suspects beating up a black sultan that had 2 Vagos members inside of the vehicle. @160 made contact with the suspects and they were not a threat to @160 so he asked for permission to get the 2 downed individuals medical treatment, the suspects agreed and let @160 grab the downed suspects when one of the vagos got back up to his feet as he was just unconcus. The suspects then beat the vagos member down again and @160 told the suspects to stop and alerted them that they were going to be detained, Jerome Steppa then pulled out a golfclub and attempted to hold @160 up, I was able to run away and call for 10-78s aka emergency backup and @122 and @512 responded quickly. The suspects then ran towards the construction where they lodged themselves on top of a crane and held out before both suspects fell off the building were both downed.\n>\n> \\\n> The suspects were transported to Pillbox Medical where Nancy treated the individuals and they were taken in @160s CrownVic to MRPD where he read them there Miranda rights and proccessed both suspects.\n\n\\\n', '[{\"type\":\"photo\",\"id\":\"6930\",\"identifier\":\"https://i.imgur.com/DAq9lqd.png\",\"description\":\"DNA Swab Rory Turner\",\"cid\":\"\"},{\"type\":\"photo\",\"id\":\"2362\",\"identifier\":\"https://i.imgur.com/1eZ97sd.png\",\"description\":\"DNA Swab Jerome Steppa\",\"cid\":\"\"},{\"type\":\"photo\",\"id\":\"5668\",\"identifier\":\"https://i.imgur.com/mBNHcn6.png\",\"description\":\"Jerome Steppa Possessions\",\"cid\":\"\"},{\"type\":\"photo\",\"id\":\"2110\",\"identifier\":\"https://i.imgur.com/r54goMe.png\",\"description\":\"Jerome Steppa Golfclub\",\"cid\":\"\"},{\"type\":\"weapon\",\"id\":\"3852\",\"identifier\":\"104-aRM-659\",\"description\":\"Golf Club Belonging to Jerome Steppa\",\"cid\":\"104\"}]', '[{\"name\":\"Tyler Blood\",\"cid\":82,\"callsign\":\"122\"},{\"name\":\"Johnthan Bean\",\"cid\":62,\"callsign\":\"160\"},{\"name\":\"Rory Turner\",\"cid\":40,\"callsign\":\"512\"},{\"name\":\"Sam Das\",\"cid\":31,\"callsign\":\"103\"}]', 'null', NULL, NULL, '[{\"name\":\"Jerome  Steppa\",\"points\":0,\"charges\":[{\"id\":\"7432\",\"fine\":1500,\"points\":0,\"months\":15,\"title\":\"Assault w/ Deadly Weapon\"},{\"id\":\"7431\",\"fine\":750,\"points\":0,\"months\":10,\"title\":\"Resisting Arrest\"},{\"id\":\"9457\",\"fine\":500,\"points\":0,\"months\":10,\"title\":\"Threat to Bodily Harm\"}],\"guilty\":true,\"fine\":2750,\"cid\":104,\"processed\":true,\"warrantdate\":0,\"months\":35,\"warrant\":false}]'),
(4, 'Sander Jones - Traffic Citation', 'Johnthan Bean', '1654992248', '**LSPD Report**\n\n2022-06-22\n\n**Reporting Officer:**\n\n@160 J.Bean\n\n**Location:**\n\nVespucci and Strawberry\n\n**Debrief:**\n\n\\\n**@160 J.Bean Statement:**\n\n> @160 was patrolling when he witnessed the suspect driving a black in color sultan with a spoiler make a drifting left sided turn from Strawberry Ave onto Vespucci Blvd. @160 lit the vehicle up when the suspects complied and pulled over, after making contact with the suspect the suspect was truthful and told @160 he did not have a drivers license on his person, @160 agreed in good faith to have the suspect tell him his name. @160 confirmed it was the suspect and ticketed him for speeding and gave a warning to make sure to carry his license at all time.\n\n\\\n', '[{\"cid\":\"\",\"id\":\"8001\",\"type\":\"photo\",\"identifier\":\"https://i.imgur.com/okBQ9Ug.png\",\"description\":\"Radar Reading\"}]', '[{\"name\":\"Johnthan Bean\",\"cid\":62,\"callsign\":\"160\"}]', 'null', NULL, NULL, '[{\"guilty\":false,\"processed\":true,\"months\":0,\"cid\":4,\"warrantdate\":0,\"name\":\"Sanders Jones\",\"charges\":[{\"months\":0,\"points\":0,\"id\":\"5392\",\"fine\":1000,\"title\":\"Speeding 20mph over\"}],\"fine\":1000,\"points\":0,\"warrant\":false}]'),
