(6, 'Kortz Center Shooting', 'Alex Brooks', '1655060248', '**LSPD Report**\n2022-06-12 14:06:15\n**Reporting Officer** @123 Sergeant Alex Brooks\n\n**Assisting Officer/s:**  So many\n\n**Suspect/s: Lennox Booth,** Tyrone Driggs, Kane Barnett\n\n**Victim/s:**\n**Witnesses:**\n**Location:**\n**Debrief:**\n\n@123- @123 was handling a scene in leigon when @212 requested immidiate backup near North Rockford Drive by the Kortz Center. The suspects had stolen a police CVPI and was fleeing westbound on Ace Jones Drive approaching North Rockford Drive, there were other intercepting suspects in stolen vehicles. @123 first got eyes on the suspects going North on Kortz Drive, going up to the Kortz Center. The suspects were ramming police vehicles off the mountain and into walls. Officers were able to get the suspects boxed in a corner, where they got out and fled on foot into the Kortz Center and took to the roofs where they opened fire on officers. Officers were able to gun down all the suspects and get them in custody. Officers transported the suspects and downed officers to Pillbox for medical and then MRPD for processing. While processing @123 and @160 conducted an unsuccesful raid on both suspects with PD equipment. When @123 arrived back at MRPD Lennox Booth was missing from his cell, upon furthur investigation @140 witnessed @212 take Lennox and put him in a vehicle and then go off duty.\n\n\\\n==@160 - during the whole shooting and after while being proccessed @212 was being provacative and acting like a thug with a badge and was overall being a douche to the suspects==', '[{\"id\":\"7207\",\"type\":\"weapon\",\"cid\":\"\",\"identifier\":\"cartridge: 40-qve-457 | serial: 40\",\"description\":\"Lennox Booth PD Glock\"},{\"id\":\"8853\",\"type\":\"weapon\",\"cid\":\"\",\"identifier\":\"cartridge: 10-lUA-572 | serial: 10\",\"description\":\"Lennox Booth Class 1\"},{\"id\":\"4842\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/985623916640878672/lennox_gsr.JPG\",\"description\":\"Lennox Booth GSR\"},{\"id\":\"5443\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/985623916976427018/possess.JPG\",\"description\":\"Lennox Booth Possessions\"},{\"id\":\"4497\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/Btlf0dp.png\",\"description\":\"Tyrone Driggs ID\"},{\"id\":\"0911\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/F2mLh18.png\",\"description\":\"Tyrone Driggs Possessions\"},{\"id\":\"1744\",\"type\":\"weapon\",\"cid\":\"\",\"identifier\":\"48-UYV-82\",\"description\":\"Tyrone Driggs Beretta M9\"},{\"id\":\"8481\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/DmSeZkF.png\",\"description\":\"Tyrone Driggs Possesions x2\"}]', '[{\"callsign\":\"101\",\"cid\":16,\"name\":\"Alex Hernandez\"},{\"callsign\":\"160\",\"cid\":62,\"name\":\"Johnthan Bean\"},{\"callsign\":\"123\",\"cid\":71,\"name\":\"Alex Brooks\"},{\"callsign\":\"140\",\"cid\":37,\"name\":\"Kyle Langston\"},{\"callsign\":\"120\",\"cid\":24,\"name\":\"Billy King\"},{\"callsign\":\"212\",\"cid\":160,\"name\":\"Timothy  Jenkins\"},{\"callsign\":\"512\",\"cid\":40,\"name\":\"Rory Turner\"}]', '[{\"name\":\"Tyrone Driggs\",\"cid\":81},{\"name\":\"Lennox Booth\",\"cid\":48},{\"name\":\"Kane Barnett\",\"cid\":60}]', NULL, NULL, '[{\"months\":110,\"processed\":false,\"fine\":12250,\"name\":\"Lennox Booth\",\"charges\":[{\"fine\":3500,\"title\":\"Attempted Murder of a Peace Officer\",\"months\":30,\"points\":0,\"id\":\"6716\"},{\"fine\":2500,\"title\":\"Criminal Possession of a Government Issued Firearm\",\"months\":20,\"points\":0,\"id\":\"0602\"},{\"fine\":1000,\"title\":\"Negligent Discharge of a Firearm/Weapon in Public\",\"months\":15,\"points\":0,\"id\":\"3806\"},{\"fine\":1500,\"title\":\"Grand Theft Auto\",\"months\":10,\"points\":0,\"id\":\"8375\"},{\"fine\":1500,\"title\":\"Reckless Driving\",\"months\":10,\"points\":5,\"id\":\"0197\"},{\"fine\":1500,\"title\":\"Possession of a Stolen Government Vehicle\",\"months\":15,\"points\":0,\"id\":\"1089\"},{\"fine\":750,\"title\":\"Resisting Arrest\",\"months\":10,\"points\":0,\"id\":\"6750\"}],\"warrantdate\":0,\"warrant\":false,\"points\":5,\"guilty\":false,\"cid\":48},{\"months\":95,\"processed\":true,\"fine\":10750,\"name\":\"Tyrone Driggs\",\"charges\":[{\"fine\":1500,\"title\":\"Poss. of a Class 1 Illegal Firearm\",\"months\":10,\"points\":0,\"id\":\"6805\"},{\"fine\":3500,\"title\":\"Attempted Murder of a Peace Officer\",\"months\":30,\"points\":0,\"id\":\"3260\"},{\"fine\":750,\"title\":\"Resisting Arrest\",\"months\":10,\"points\":0,\"id\":\"7855\"},{\"fine\":1500,\"title\":\"Possession of a Stolen Government Vehicle\",\"months\":15,\"points\":0,\"id\":\"1224\"},{\"fine\":2000,\"title\":\"Felony Evading Law Enforcement (Vehicle)\",\"months\":15,\"points\":0,\"id\":\"1808\"},{\"fine\":1500,\"title\":\"Criminal Possession of Government Issued Equipment\",\"months\":15,\"points\":0,\"id\":\"4466\"}],\"warrantdate\":0,\"warrant\":false,\"points\":0,\"guilty\":true,\"cid\":81},{\"months\":90,\"processed\":true,\"fine\":10250,\"name\":\"Kane Barnett\",\"charges\":[{\"fine\":2500,\"title\":\"Criminal Possession of a Government Issued Firearm\",\"months\":20,\"points\":0,\"id\":\"9038\"},{\"fine\":750,\"title\":\"Resisting Arrest\",\"months\":10,\"points\":0,\"id\":\"1944\"},{\"fine\":1500,\"title\":\"Possession of a Stolen Government Vehicle\",\"months\":15,\"points\":0,\"id\":\"9681\"},{\"fine\":2000,\"title\":\"Felony Evading Law Enforcement (Vehicle)\",\"months\":15,\"points\":0,\"id\":\"6955\"},{\"fine\":3500,\"title\":\"Attempted Murder of a Peace Officer\",\"months\":30,\"points\":0,\"id\":\"6057\"}],\"warrantdate\":0,\"warrant\":false,\"points\":0,\"guilty\":true,\"cid\":60}]'),
(7, 'Officer Corruption', 'Johnthan Bean', '1655067350', '**LSPD Report**\n2022-06-12 15:06:40\n**Reporting Officer**\n@160 Officer Johnthan Bean\n**Assisting Officer/s:**\n**Suspect/s:**\n**Victim/s:**\n**Witnesses:**\n**Location:**\n**Debrief:**\n\n\\\n**@160 J. Bean Statment:**\n\n> Prior to report #6: ==during the whole shooting and after while being proccessed @212 was being provacative and acting like a thug with a badge and was overall being a douche to the suspects==\n>\n> \\\n> Everything stated is from after report #6.\n>\n> @160 and @123 were getting ready for a raid on two suspects who were both in possession of PD Glocks, while sitting in the motor pool @212 and @504 were seen getting into the LSPD Explorer with 1x Lennox Booth. @160 and @123 did not get worried about the odd event and headed out towards the Alta St. Apts. When @160 went to turn onto Alta St from Vespucci Blvd @212 passed and radiod out 212 going 10-7 a few mikes. @160 and @123 attempted there raids and due to some scuff were unabled to complete the raid and headed back to MPRD when they noticed the Lennox Booth was still not back in his cell and were alarmed. After radioing asking about the scene @160 proccessed the one suspect in custody and went back on patrol. About 20 minutes later there was 2 dispach calls at the Shank St docks, one being shots fired and another one being a downed individual. @101 and @105 were in the area so he code 6d or investigated the scene and noticed a suspicious LSPD Explorer with 2 individuals inside and lit up the vehicle on Adams Apple Blvd near Calasis Ave. @160 was in the area so he procceeeded to back up the other units, when he realized who it was he alerted the officers of the prior scene. @160, @101, @105 then detained both officers, mirdandized and split them up for quick questioning while still on scene of the traffic stop. After realizing that this could be some type of corrupt cop shit we agreed to take them back to MRPD for proper questioning. After arriving at MRPD we took them both the seperate interrogation rooms and took turns interrogating them. Other units went to the Shank St Dock to attempt to locate a suspect, after searching for 10 minutes no body or any casings turned up so they left the scene.\n>\n> \\\n> While questioning @212 he claimed @201 Cooper Marshall told him to go off duty to search for criminals in Little Seoul which didnt make sense to officers as to why he was so far from Little Seoul. @101, @105, @163 then took eachothers statements, the statements of other officers from all prior scenes, and then headed to Boiling Brooke where the other suspects from the Kortz center shooting claimed they have not seen Lennox Booth. After questioning @504 he pled the 5th even after being offered a plea deal.\n>\n> \\\n> ==@101 adn @160 agreed it would be best to place the two corrupt cops on a hold until trial and sent them for the 9s.==\n\n\\\n**@123 A. Brooks Statement**\n\n> After an incident at the Kortz center @123 and @160 were conducting a raid when Timothy Jenkins said over radio @212 going 10-7 and off radio for a few mikes. When arriving back at MRPD @123s suspect Lennox Booth was missing from his cell. @140 told officers that he saw Timothy Jenkins go off duty and put Lennox into a Police Vehicle and drive off. A few minutes later while @123 was conducting a traffic stop a shots fired and an injured person call at the Civilian Docks on Shank St. While @123 was on his way he spotted a Police Explorer heading North on Calais Ave and taking a right Eastbound on Adams Apple Blvd. Upon arriving at the Civ. Docks @123 couldnt find any evidence or body pointing to the crime. When reconveining with @101 who pulled the Police Explorer over he already had both officers in cuffs and ready to transport to MRPD for questioning. When arriving at MRPD the officers transported the suspects to the interigation rooms and began questioning @123 did not participate in questioning, nor processing.\n\n\\\n**EMS REPORT:**\n\n> Report title: Lennox Booth / / GSW + Water in lungs / / 12.06 \\[NANCY\\]\n>\n> Submitted to ICU?: NO\n>\n> Incident Report:  Lennox Booth was brought into the ER unconscious by local paramedics. Upon arrival, I was immediately able to visibly see that the top of his head was completely scalped. The  \\\\n origin of these injuries is unknown.\n>\n> List of Injuries: Scalped head; 4 GSWS to upper back area; Water in lungs\n>\n> Surgical Report:\n>\n> * 2 out of  4 bullets had to be surgically removed.\n> * All GSWS were sutured.\n> * Head had to be disinfected and wrapped in gauze + skin tissue had to be taken from his thigh to be surgically implanted on his head. (hair growth non recoverable)\n> * Anemia Due to Excessive Bleeding\n> * Lungs had to be pumped due to excessive amounts of water  recovery rate 100%\n>\n> \\\n\n\\\n', '[{\"description\":\"Timothy Jenkins PD Glock\",\"type\":\"\",\"id\":\"4297\",\"identifier\":\"160-TcI-991\",\"cid\":\"\"},{\"description\":\"Timothy Jenkins PD Glock\",\"type\":\"\",\"id\":\"5782\",\"identifier\":\"160-TcI-991\",\"cid\":\"\"},{\"description\":\"Timothy Jenkins PD Glock\",\"type\":\"weapon\",\"id\":\"4684\",\"identifier\":\"160-TcI-991\",\"cid\":\"\"},{\"description\":\"Timothy Jenkins Possessions\",\"type\":\"photo\",\"id\":\"9372\",\"identifier\":\"https://i.imgur.com/s8LTNRp.png\",\"cid\":\"\"},{\"description\":\"Weapons found on Josh Des\",\"type\":\"weapon\",\"id\":\"9554\",\"identifier\":\"10-fid-668\",\"cid\":\"\"}]', 'null', 'null', NULL, NULL, '[{\"months\":0,\"name\":\"Timothy  Jenkins\",\"warrant\":false,\"guilty\":false,\"warrantdate\":0,\"charges\":[],\"processed\":false,\"fine\":0,\"cid\":160,\"points\":0},{\"months\":0,\"name\":\"Josh  Des\",\"warrant\":false,\"guilty\":false,\"warrantdate\":0,\"charges\":[],\"processed\":false,\"fine\":0,\"cid\":161,\"points\":0}]'),
(8, 'Von Renshaw - Assault on Public Servant', 'Johnthan Bean', '1655068640', '**LSPD Report**\n2022-06-12 16:06:86\n**Reporting Officer**\n@160 Officer Johnthan Bean\n**Assisting Officer/s:**\n\n@122, @105, @123 \n\n**Location:**\n\nMPRD Lobby \n\n**Debrief:**\n\n\\\n**@160 J. Bean Statement:** \n\n> @160 was in MRPD getting changed when he overheard on radio an officer yelling about his partner @122 getting beat down in the Lobby at MRPD. @160 and @105 noticed a guy in yellow standing over the body and detained him, during questioning we were notified on radio that it was a guy in all green suit. We let go of the yellow guy and went back on patrol. 5 minutes later while @160 was in the motor pool of MRPD @160 noticed a individual in an all green suit, @160 told him to put his hands up and that he was being detained after questioning what was the matter he surrendered. @160 explained the situation and @122 confirmed that it was the suspect who beat him up. @160 proccessed the suspect and after being read his charge he was given time served and billed then freed.\n\n\\\n', '[{\"id\":\"1460\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/CDj9dnq.png\",\"description\":\"Von Renshaws Possesions\"}]', '[{\"callsign\":\"105\",\"cid\":88,\"name\":\"Miguel Hernandez\"},{\"callsign\":\"160\",\"cid\":62,\"name\":\"Johnthan Bean\"},{\"callsign\":\"123\",\"cid\":71,\"name\":\"Alex Brooks\"}]', 'null', NULL, NULL, '[{\"months\":10,\"name\":\"Von Renshaw\",\"warrant\":false,\"guilty\":true,\"warrantdate\":0,\"charges\":[{\"months\":10,\"points\":0,\"title\":\"Assault On Public Servant\",\"fine\":1250,\"id\":\"3454\"}],\"processed\":true,\"fine\":1250,\"cid\":76,\"points\":0}]'),
(9, 'Lucas James - Assault with a deadly', 'Tyler Blood', '1655068945', '**LSPD Report**\n2022-06-12 23:06:50\n**Reporting Officer**\n@122 Sergeant Tyler Blood\n**Assisting Officer/s:**\n**Suspect/s:**\n**Victim/s:**\n**Witnesses:**\n\n**Location:** Front Of MRPD\n\n**Debrief:** 122 tyler blood and other officers heard shots outside pd so we went outside and saw mr James shooting at people and he got shot down by officers he then got searched taken to pillbox nancy helped him up then he got mirandised and taken to pd and sent off and plead guilty', '[{\"id\":\"2175\",\"type\":\"photo\",\"cid\":\"166\",\"identifier\":\"https://i.imgur.com/Xmk46AD.jpg\",\"description\":\"Weapon on Lucas James 1/2\"},{\"id\":\"8142\",\"type\":\"photo\",\"cid\":\"166\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/985654774881988618/unknown.png\",\"description\":\"Weapon on Lucas James 2/2\"}]', '[{\"callsign\":\"160\",\"cid\":62,\"name\":\"Johnthan Bean\"},{\"callsign\":\"122\",\"cid\":82,\"name\":\"Tyler Blood\"},{\"callsign\":\"105\",\"cid\":88,\"name\":\"Miguel Hernandez\"}]', 'null', NULL, NULL, '[{\"months\":35,\"processed\":false,\"warrant\":false,\"guilty\":true,\"points\":0,\"charges\":[{\"months\":15,\"points\":0,\"title\":\"Assault w/ Deadly Weapon\",\"fine\":1500,\"id\":\"0207\"},{\"months\":15,\"points\":0,\"title\":\"Negligent Discharge of a Firearm/Weapon in Public\",\"fine\":1000,\"id\":\"5462\"},{\"months\":5,\"points\":0,\"title\":\"Illegal Brandishing of Firearm\",\"fine\":1000,\"id\":\"8618\"}],\"name\":\"Lucas James\",\"fine\":3500,\"warrantdate\":0,\"cid\":166}]'),
