(12, 'Tom Lewis in shootout Oil Flieds', 'Rory Turner', '1655070701', '**LSPD Report** 2022-06-12 23:06:30\n\n**Reporting Officer** @512 Cadet Rory Turner\n\n**Assisting Officer/s: 140 Kyle Langston** \n\n**Suspect/s:** **Victim/s:**\n\n**Witnesses:** **Location:** Oil Flieds\n\n**Debrief: 512 responsing to alta street down person 47 me and 140 respond and see a orange suv car coming out Alta apartments, Went to pillbox blue mask guy said these people was shoot at and 512 and 140 went into 80 and ended up at oil fields and 512 and 140 got shot at luckily we didnt get downed we use our ifak and armour to protect our slef then went on foot and shoot them back. they 50 into wall and 50 flippled and 2 people came out the car and gun down last person Frank Lewis reach for pocket came out the car 512 tazed him 95 him**', '[{\"id\":\"8387\",\"cid\":\"164\",\"type\":\"photo\",\"identifier\":\"https://images-ext-2.discordapp.net/external/fblXD7Rh2i8vYcPblKYi75GBw8hon-w6vh7iv_mjnDE/https/puu.sh/J5xqc/16c8d2d99d.jpg?width=713&height=401\",\"description\":\"Tom Lewis\"},{\"id\":\"3870\",\"cid\":\"164\",\"type\":\"photo\",\"identifier\":\"https://puu.sh/J5xqp/81c2e0afbc.png\",\"description\":\"Tom Lewis\"}]', '[{\"callsign\":\"140\",\"cid\":37,\"name\":\"Kyle Langston\"},{\"callsign\":\"206\",\"cid\":32,\"name\":\"Brandon Taz\"},{\"callsign\":\"122\",\"cid\":82,\"name\":\"Tyler Blood\"}]', '[{\"name\":\"FRANK LEWIS\",\"cid\":158},{\"name\":\"Greg Smith\",\"cid\":156}]', NULL, NULL, '[{\"months\":15,\"processed\":true,\"warrant\":false,\"guilty\":true,\"warrantdate\":0,\"charges\":[{\"months\":15,\"points\":0,\"id\":\"2920\",\"fine\":1500,\"title\":\"Assault w/ Deadly Weapon\"}],\"cid\":164,\"fine\":1500,\"name\":\"Tom Lewis\",\"points\":0}]'),
(13, 'Orange Gang - Crip - Shooting Incident \"WARRANT DONE\"', 'Alex Hernandez', '1655076115', '**LSPD Report**\n\n\\\n@512 Rory Turner\n\nDid the Warrnet Mr Booth came in to serve his time and not have anything on him but does not pleaded guilty at all this time\n\n2022-06-15 BST 13:30\n\n\\\n2022-06-12 19:06:79\n**Reporting Officer** @101 Chief Of Police Alex Hernandez\n\n**Suspect/s:**\n\nLennox Booth\n\nOrange Gang\n\n**Victim/s:**\n\nTyrone Jacqual - GSR Positive\n\nSamel Williams - GSR Positive\n\n**Witnesses:**\n\n**Alex Hernandez**\n\n**Location:**\n\n**==Murrieta Heights / Elysian Fields Fwy==**\n\n**Debrief:**\n\n**@101 Alex Hernandez Statement**\n\nDispatch reported shots fired all over the city. 101 responded to the shots fired Code-1 (No lights, no sirens) because he was the only Officer on duty at the time. 101 witnessed a group of 4 wearing orange bandannas on scene and 2 downed individuals. The suspects in orange took off in a black 4 door buffalo and 101 stayed on scene, gave first aid and collected evidence. The victims were transported to Pillbox and questioned after treated.\n\n\\\n**Tyrone Jacqual Statement**\n\nWhat Samel Williams said\n\n**Samel Williams Statement**\n\nOrange Gang they have turf on marathon ave, and they have pistols.\n\n\\\n', '[{\"description\":\"Scene of Shooting 1/3\",\"id\":\"2603\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/OOO4UWe.jpeg\"},{\"description\":\"Scene of Shooting 2/3\",\"id\":\"8845\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/kJILzrY.jpeg\"},{\"description\":\"Scene of Shooting 3/3\",\"id\":\"4955\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/DqLGyhM.jpeg\"},{\"description\":\"MDW Reports\",\"id\":\"3209\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/cLZHrr7.png\"},{\"description\":\"GSR Positive - Samel Williams\",\"id\":\"9858\",\"type\":\"photo\",\"cid\":\"51\",\"identifier\":\"https://i.imgur.com/pPdNC8n.png\"},{\"description\":\"Casing\",\"id\":\"5798\",\"type\":\"casing\",\"cid\":\"24\",\"identifier\":\"24-szS-355\"},{\"description\":\"Casing\",\"id\":\"7083\",\"type\":\"casing\",\"cid\":\"10\",\"identifier\":\"10-XYg-325\"},{\"description\":\"Samel Williams\",\"id\":\"0593\",\"type\":\"blood\",\"cid\":\"51\",\"identifier\":\"DNA - 51\"},{\"description\":\"Tyrone Jacqual\",\"id\":\"3585\",\"type\":\"blood\",\"cid\":\"10\",\"identifier\":\"DNA - 10\"}]', '[{\"callsign\":\"101\",\"cid\":16,\"name\":\"Alex Hernandez\"}]', '[{\"cid\":10,\"name\":\"Tyrone Jacqual\"},{\"cid\":48,\"name\":\"Lennox Booth\"},{\"cid\":51,\"name\":\"Samel Williams\"}]', NULL, NULL, '[{\"warrantdate\":\"1657835763\",\"processed\":true,\"guilty\":true,\"points\":0,\"fine\":3500,\"name\":\"Lennox Booth\",\"warrant\":false,\"charges\":[{\"points\":0,\"title\":\"Gang Related Shooting\",\"fine\":3500,\"id\":\"0541\",\"months\":25}],\"cid\":48,\"months\":25}]'),
(14, 'Jack Miller/Pablo Ortega - Incomplete', 'Paul Blart', '1655087866', '**LSPD Report** 2022-06-12 19:06:65\n\n**Reporting Officer** @undefined Cadet Paul Blart\n\n**Assisting Officer/s:**\n\nN/A\n\n**Suspect/s:** **Victim/s:**\n\nJack Miller/Xavier Trey/Pablo Ortega\n\n**Witnesses:**\n\nN/A\n\n**Location:**\n\nDel Perro Fwy.\n\nLos Santos\n\n**Debrief:**\n\n\\\nThis report is in correlation to report ID:19, Xavier Trey.\n\nIn the same shootout that Mr.Trey was wanted for Mr.Miller/Mr.Ortega was neitralized and brought to pillbox to recieve medical attention, once he was there he was searched and we discovered that he was in possesion of government issued property. Likley stolen in a previous shootout with GSF. he has been placed on a 48 Hour hold until I search warrant can be signed.\n\n\\\n', '[{\"id\":\"0221\",\"type\":\"photo\",\"description\":\"Raid\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/986059458549530684/Screenshot_882.png\",\"cid\":\"\"}]', 'null', 'null', NULL, NULL, '[{\"points\":0,\"warrantdate\":0,\"cid\":182,\"name\":\"Jack Miller\",\"warrant\":false,\"months\":30,\"charges\":[{\"points\":0,\"id\":\"9924\",\"fine\":2000,\"title\":\"Felony Evading Law Enforcement (Vehicle)\",\"months\":15},{\"points\":0,\"id\":\"4376\",\"fine\":1000,\"title\":\"Poss. of Weapon w/ Criminal Intent\",\"months\":15}],\"fine\":3000,\"guilty\":true,\"processed\":true},{\"points\":0,\"warrantdate\":0,\"cid\":180,\"name\":\"Pablo Ortega\",\"warrant\":false,\"months\":45,\"charges\":[{\"points\":0,\"id\":\"9096\",\"fine\":3500,\"title\":\"Attempted Murder of a Peace Officer\",\"months\":30},{\"points\":0,\"id\":\"3854\",\"fine\":1500,\"title\":\"Criminal Possession of Government Issued Equipment\",\"months\":15}],\"fine\":5000,\"guilty\":false,\"processed\":false}]'),
(15, 'Trevor Chapmann + Jack LiftonGTA + Assault', 'Bobby Snow', '1655134672', '**LSPD Report**\n2022-06-13 08:06:04\n**Reporting Officer** @161 Officer Bobby Snow \n\n**Assisting Officer/s: N/A** \n\n**Suspect/s: Trevor Chapmann & Jack Lifton**\n\n**Victim/s:** N/A\n\n**Witnesses:** N/A\n\n**Location: UwU Cafe, Little Seoul** \n\n**Debrief: @161 Bobby Snow attepted to pull over Mr. Chapmann in his red in colored super car. Mr. Chapmann then fled and ignored Officers Snow and lead into a high speed chase across town and ended in Little Seoul when both men tried assaulting Officer Snow. Both men were then tased and cuffed and were processed in MRPD.**', 'null', '[{\"name\":\"Bobby Snow\",\"callsign\":\"161\",\"cid\":45}]', '[{\"name\":\"Trevor Chapmann\",\"cid\":110},{\"name\":\"Jack Lifton\",\"cid\":121}]', NULL, NULL, '[{\"warrant\":false,\"charges\":[{\"months\":10,\"title\":\"Grand Theft Auto\",\"id\":\"8729\",\"fine\":1500,\"points\":0},{\"months\":10,\"title\":\"Reckless Driving\",\"id\":\"1375\",\"fine\":1500,\"points\":5},{\"months\":15,\"title\":\"Assault\",\"id\":\"6456\",\"fine\":1500,\"points\":0}],\"fine\":4500,\"guilty\":true,\"months\":35,\"points\":5,\"name\":\"Trevor Chapmann\",\"warrantdate\":0,\"processed\":true,\"cid\":110},{\"warrant\":false,\"charges\":[{\"months\":15,\"title\":\"Assault\",\"id\":\"5568\",\"fine\":1500,\"points\":0}],\"fine\":1500,\"guilty\":true,\"months\":15,\"points\":0,\"name\":\"Jack Lifton\",\"warrantdate\":0,\"processed\":true,\"cid\":121}]'),
(16, 'OIS - Pillbox', 'Johnthan Bean', '1655136792', '**LSPD Report** 2022-06-13\n\n**Reporting Officer**\n\n@160 Johnthan Bean\n\n**Location:**\n\nPillbox Medical\n\n**Debrief:**\n\n\\\n**@160 Jonthan Bean Statement:**\n\n> @160 was patroling when @161 called out on radio that he needed additionals at Pillbox Medical because there were alot of people. @160 was enroute when @161 hit his 13a panic button so @160 turned on his lights and sped down the freeway to assist. When @160 arrived he cleared the front lobby when 2 suspects ran out of the hallway and started punching @160, out of fear for his life @160 pulled his service PD glock and started shooting the suspects. After @160 got the 2 suspecst downed another ran out and was allmost successful at beating @160 down when @140 came and shot the last suspect down. \n>\n> \\\n> @160 helped @161 back to his feet where he testified that it was the right suspects. ALl suspects were treated by nancy and taken to MRPD where they were proccessed and sent to prison. \n\n\\\n', '[{\"description\":\"Scene\",\"id\":\"6985\",\"identifier\":\"https://i.imgur.com/AWCGyLp.jpeg\",\"cid\":\"\",\"type\":\"photo\"},{\"description\":\"Scene\",\"id\":\"1139\",\"identifier\":\"https://i.imgur.com/FKn0B3Z.jpeg\",\"cid\":\"\",\"type\":\"photo\"},{\"description\":\"Manny Smith DNA Swab\",\"id\":\"2910\",\"identifier\":\"https://i.imgur.com/gFyPc8p.png\",\"cid\":\"\",\"type\":\"photo\"},{\"description\":\"Manny Smith Possessions\",\"id\":\"6338\",\"identifier\":\"https://i.imgur.com/I8xey7v.png\",\"cid\":\"\",\"type\":\"photo\"}]', '[{\"name\":\"Johnthan Bean\",\"callsign\":\"160\",\"cid\":62},{\"name\":\"Bobby Snow\",\"callsign\":\"161\",\"cid\":45},{\"name\":\"Kyle Langston\",\"callsign\":\"140\",\"cid\":37}]', 'null', NULL, NULL, '[{\"warrant\":false,\"charges\":[{\"months\":10,\"title\":\"Assault On Public Servant\",\"id\":\"3521\",\"fine\":1250,\"points\":0},{\"months\":30,\"title\":\"Attempted Murder of a Peace Officer\",\"id\":\"1012\"