(19, 'Xavier Trey - Search Warrant', 'Paul Blart', '1655165077', '**LSPD Report**\n2022-06-13 17:06:38\n**Reporting Officer**\n@507 Cadet Paul Blart\n**Assisting Officer/s:**\n\nN/A \n\n**Suspect/s:**\n\n**Xavier Trey**\n**Victim/s:**\n\nLSPD \n\n**Witnesses:**\n\nN/A \n\n**Location:**\n\nDel Perro Fwy. \n\n**Debrief:**\n\n\\\nAfter engaging in a shootout with Jack Miller, Mr.Trey Took highground on an overpass and attempted to murder 2 officers. He then fled the scene without a trace until we re-gained visual at alta st. he then shot at me and continued pursuit. The suspect was neutralized and brought to pillbox for medical attention.\n\n\\\n48 Hr. Hold per Alex Hernandez', '[{\"id\":\"4813\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/986059458125918228/Screenshot_884.png\",\"description\":\"Raid\",\"cid\":\"\",\"type\":\"photo\"}]', 'null', 'null', NULL, NULL, '[{\"charges\":[],\"warrantdate\":0,\"guilty\":false,\"name\":\"Xavier Trey\",\"months\":0,\"processed\":false,\"warrant\":false,\"fine\":0,\"cid\":183,\"points\":0}]'),
(20, 'Alta Apt. Shootout - Dude Guy', 'Dude Guy', '1655167510', '**LSPD Report**\n2022-06-13 20:06:46\n**Reporting Officer**\n@undefined Cadet Dude Guy\n\n**Location:** ==Alta Street Apartments==\n\n**Debrief:**  Massive shootout at the Alta Streeet Apartments occurred. I arrived on scene late. No bodies were to be seen. Several cars took off in different directions. I pursued one but was pit out of the chase by another car. Returned to the scene and canvased the area. Found almost 100 shell casings/impacts. Multiple pools of blood. \n\n\\\nAnonymous tip from bystander - \n\n> It was dem orang guys mang. They just blasted the shit out dem blue guys mang.\n\n\\\n', '[{\"id\":\"4787\",\"identifier\":\"53-wJz-211\",\"description\":\"Lmar Jones - Casing\",\"cid\":\"53\",\"type\":\"casing\"},{\"id\":\"1425\",\"identifier\":\"10-sDF-384\",\"description\":\"Tyrone Jacquel - Casing (1/2)\",\"cid\":\"10\",\"type\":\"casing\"},{\"id\":\"1948\",\"identifier\":\"10-hcw-682\",\"description\":\"Tyrone Jacquel - Casing (2/2)\",\"cid\":\"10\",\"type\":\"casing\"},{\"id\":\"1703\",\"identifier\":\"62-hfS-123\",\"description\":\"Johnathon Bean - Casing\",\"cid\":\"62\",\"type\":\"casing\"},{\"id\":\"0765\",\"identifier\":\"99\",\"description\":\"Kaden Cole - Blood\",\"cid\":\"99\",\"type\":\"blood\"},{\"id\":\"2701\",\"identifier\":\"101\",\"description\":\"Skylar Barnett - Blood\",\"cid\":\"101\",\"type\":\"blood\"},{\"id\":\"4485\",\"identifier\":\"21\",\"description\":\"Caz Urboy - Blood\",\"cid\":\"21\",\"type\":\"blood\"},{\"id\":\"5610\",\"identifier\":\"10\",\"description\":\"Tyrone Jacquel - Blood\",\"cid\":\"10\",\"type\":\"blood\"},{\"id\":\"5062\",\"identifier\":\"61\",\"description\":\"Jamal Montana - Blood\",\"cid\":\"61\",\"type\":\"blood\"},{\"id\":\"7272\",\"identifier\":\"51\",\"description\":\"51 - Samel Williams - Blood\",\"cid\":\"51\",\"type\":\"blood\"},{\"id\":\"4544\",\"identifier\":\"https://media.discordapp.net/attachments/739527437788119067/9860518239935160