(21, 'Lmar Jones - Attempted Murder', 'Johnthan Bean', '1655231939', '**LSPD Report**\n2022-06-14 13:06:43\n**Reporting Officer** \n\n**@160 Officer Johnthan Bean**\n**Victim/s:**\n\nJames Joyce\n\n**Debrief:**\n\n\\\n**@160 J. Bean Statement:**\n\n> @160 was patrolling when dispatch received multiple 911s from James Joyce claiming he was being approachced by a suspicous man on Vespucci Blvd. After a few minutes dispatch alerted of gun shots and then a downed individual at the same location of the 911. Afterwards @160 headed to the location of the shots fired and found an abandoned faggio and about 10 shell casings on the scene. @160 then headed to pillbox after EMS notified @160 about a man carrying a weapon dropping off a downed individual and leaving in a brown colored van. After questioning the individual who was shot @160 went on patrol when he noticed a vehicle matching the described one. @160 attempted to pull over the van when the suspect fled the scene and was finally stopped at Alta St Apts in the parking lot. After another suspect tried to help the suspect was able to evade while @160 arrested another suspect who was obstructing justice, later he popped his head at pillbox. After placing the second suspect in @160s crownvic LMAR Jones came back and shot @160 when @160 pulled his service weapon and downed the suspect. After being cuffed @160 took both individuals to Pillbox where an ems worker and Nancy successfully rececitated both suspects.\n\n\\\n> @160 then took the suspect to MRPD where he did not comply and after 15 minutes @160 just billed and sent him off for 75% of his time and fine. @160 also removed the suspects weapons license.\n\n\\\n', '[{\"description\":\"GSR Test\",\"type\":\"photo\",\"id\":\"8318\",\"identifier\":\"https://i.imgur.com/zFUJ30l.png\",\"cid\":\"\"},{\"description\":\"DNA Swab\",\"type\":\"photo\",\"id\":\"2158\",\"identifier\":\"https://i.imgur.com/tbta1lC.png\",\"cid\":\"\"},{\"description\":\"Possessions\",\"type\":\"photo\",\"id\":\"4716\",\"identifier\":\"https://i.imgur.com/s6Yfokr.png\",\"cid\":\"\"},{\"description\":\"Crime Scene #1\",\"type\":\"photo\",\"id\":\"4825\",\"identifier\":\"https://i.imgur.com/TenXhtv.png\",\"cid\":\"\"},{\"description\":\"Crime Scene #2\",\"type\":\"photo\",\"id\":\"2869\",\"identifier\":\"https://i.imgur.com/slTer9A.jpeg\",\"cid\":\"\"},{\"description\":\"Beretta M9 on Scene\",\"type\":\"weapon\",\"id\":\"6356\",\"identifier\":\"53-wJz-211\",\"cid\":\"\"},{\"description\":\"911 Calls\",\"type\":\"photo\",\"id\":\"7644\",\"identifier\":\"https://i.imgur.com/NscwM6w.png\",\"cid\":\"\"}]', '[{\"callsign\":\"160\",\"name\":\"Johnthan Bean\",\"cid\":62}]', '[{\"name\":\"LMAR JONES\",\"cid\":53},{\"name\":\"James Joyce\",\"cid\":214}]', NULL, NULL, '[{\"guilty\":false,\"cid\":53,\"processed\":true,\"warrantdate\":0,\"months\":75,\"fine\":8000,\"name\":\"LMAR JONES\",\"charges\":[{\"months\":15,\"id\":\"8301\",\"fine\":1500,\"title\":\"Assault w/ Deadly Weapon\",\"points\":0},{\"months\":10,\"id\":\"6460\",\"fine\":1250,\"title\":\"Assault On Public Servant\",\"points\":0},{\"months\":25,\"id\":\"0008\",\"fine\":2500,\"title\":\"Attempted Murder\",\"points\":0},{\"months\":10,\"id\":\"9345\",\"fine\":750,\"title\":\"Resisting Arrest\",\"points\":0},{\"months\":15,\"id\":\"3761\",\"fine\":2000,\"title\":\"Felony Evading Law Enforcement (Vehicle)\",\"points\":0}],\"warrant\":false,\"points\":0}]'),
(22, 'Sal Vistone - Warrant - Brandon Taz let him go', 'Johnthan Bean', '1655236798', '**LSPD Report**\n2022-06-14 14:06:19\n**Reporting Officer**\n@160 Officer Johnthan Bean\n**Assisting Officer/s:**\n**Suspect/s:**\n**Victim/s:**\n**Witnesses:**\n**Location:**\n**Debrief:**\n\n\\\n**@160 J. Bean Statement:**\n\n> @160 was patrolling when he noticed a speeding blue comet speeding down Vespucci Blvd near Legion Square, after attempting to catch the vehicle the suspects were able to escape his vision and @160 called it VCB. \n>\n> \\\n> 10 minutes later @160 spotted the blue comet at the Fleeca Bank off of Vespucci Blvd. @160 attempted to detain the suspects for questioning when they evaded and @160 radiod it in as an active chase. @161 and @206 with @514 attached and we chased the vehicle for 15 minutes when another vehicle this time a black in color Coquette being driven by Sal Pistone pitted @206 and @514. @160 then primarialy focused on the black coquette while the other units chased the blue comet, all units pursued the vehicles for another 10 minutes before losing eyes on the blue comet. @160 was returning to MRPD when he heard a vehicle crash and went to check it out and recognized it was the same black coquette that was involed in the active chase. @160 then spotted a downed individual who was driving the vehicle cuffed and then placed him in @161s vehicle and @161 transported the individual to Pillbox Medical. Nancy treated the suspect and he was taken to MRPD by @160 who read him his rights before tsunami. After tsunami while in the cells @206 let him out of the cells and helped him escape from custody out the back door of MRPD.\n\n\\\n', '[{\"description\":\"Sal Piston DNA Swab\",\"id\":\"0678\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/x3IPhZi.png\"},{\"description\":\"Sal Pistone\'s Vehicle\",\"id\":\"0511\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/wxXHQ13.jpeg\"},{\"description\":\"Sal Pistone\'s Blood\",\"id\":\"4402\",\"type\":\"blood\",\"cid\":\"\",\"identifier\":\"identifier: DNA-30\"}]', '[{\"callsign\":\"160\",\"cid\":62,\"name\":\"Johnthan Bean\"},{\"callsign\":\"514\",\"cid\":193,\"name\":\"Harry Brown\"},{\"callsign\":\"161\",\"cid\":45,\"name\":\"Bobby Snow\"},{\"callsign\":\"206\",\"cid\":32,\"name\":\"Brandon Taz\"}]', 'null', NULL, NULL, '[{\"points\":0,\"warrantdate\":0,\"cid\":30,\"name\":\"Sal Vistone\",\"warrant\":true,\"months\":40,\"charges\":[{\"points\":0,\"fine\":1500,\"id\":\"4105\",\"title\":\"Obstruction of Justice\",\"months\":15},{\"points\":0,\"fine\":2000,\"id\":\"2095\",\"title\":\"Felony Evading Law Enforcement (Vehicle)\",\"months\":15},{\"points\":0,\"fine\":1250,\"id\":\"4498\",\"title\":\"Poss. of Stolen Vehicle\",\"months\":10}],\"fine\":4750,\"guilty\":false,\"processed\":false}]'),
(23, 'Ammunation shootout', 'Paul Blart', '1655244802', '**LSPD Report**\n2022-06-14 15:06:16\n**Reporting Officer** @122 Tyler Blood\n\n**Assisting Officer/s:**\n\nPaul Blart\n\n**Suspect/s:**\n\n**Victim/s:**\n\nPaul Blart\n\n**Witnesses:**\n\nN/A\n\n**Location:**\n\nAmmu-Nation\n\n**Debrief:**\n\n\\\n> Following Calls of shots fired, Myself and paul blart responded code 3 to the scene. where we discovered that Mr.Bee was on the road bleeding out, he was then searched and transported to the scene of a previous crime that he was suspected of commiting where we attached his firearm to an officer involved shooting where Cadet.Blart was shot in the chest.\n\n\\\n', 'null', 'null', 'null', NULL, NULL, '[{\"points\":0,\"warrantdate\":0,\"cid\":245,\"name\":\"Bj bee\",\"warrant\":false,\"months\":65,\"charges\":[{\"months\":30,\"fine\":3500,\"id\":\"9971\",\"title\":\"Attempted Murder of a Peace Officer\",\"points\":0},{\"months\":25,\"fine\":3500,\"id\":\"8169\",\"title\":\"Gang Related Shooting\",\"points\":0},{\"months\":10,\"fine\":1500,\"id\":\"6656\",\"title\":\"Poss. of a Class 1 Illegal Firearm\",\"points\":0}],\"fine\":8500,\"processed\":false,\"guilty\":false}]'),
