(29, 'Xaviar TrayAttepted Murder', 'Bobby Snow', '1655299903', '# **LSPD Report**\n\n## 2022-06-15 06:06:98\n\n**Reporting Officer** @161 Officer Bobby Snow\n\n**Assisting Officer/s: @122 Tyler Blood, @203 Jack Brown**\n\n**Suspect/s:** Xavier Trey, Nap Him\n\n**Victim/s: @161 Bobby Snow**\n\n**Witnesses: @122 Tyler Blood, @203 Jack Brown**\n\n**Location: Forum Drive, Misson Row Police Department**\n\n# **Debrief:** \n\n> **@161 Bobby Snow responded to shots in the call near Forum Drive, @161 then spotted Xavier Trey fleeing and @161 initiated a traffic stop. Mr. Trey then pulled out his gun and aimed it at @161. @161 Netrualized Mr. Trey and was taken to Pillbox Medical.** \n>\n> \\\n> **Mr. Trey was stuck on the bed and took a nap and @161 waited at Alta Street Apartments. @161 then spotted Nap Him walking out of his Alta Apartment and shooting a local. Mr. Trey then got in his car and Mr. Him open fired on @161 Snow. A huge holdout occured with @122 Tyler Blood and @203 Jack Brown assited during the hold out in MRPD. Nap Him was not taken into custody.**\n\n\\\n', '[{\"description\":\"GSR TEST Xavier\",\"id\":\"2759\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/UuYVPNk.png\"},{\"description\":\"Nap Him 911\",\"id\":\"3319\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/5CWxm4i.png\"},{\"description\":\"Weapon Xavier Trey Had\",\"id\":\"1666\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/ufmJx6u.png\"},{\"description\":\"Shooting Scene\",\"id\":\"3233\",\"type\":\"photo\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/kJY3NWj.jpeg\"}]', '[{\"callsign\":\"161\",\"cid\":45,\"name\":\"Bobby Snow\"},{\"callsign\":\"122\",\"cid\":82,\"name\":\"Tyler Blood\"},{\"callsign\":\"204\",\"cid\":29,\"name\":\"Jack Brown\"}]', 'null', NULL, NULL, '[{\"warrant\":false,\"points\":0,\"warrantdate\":0,\"fine\":6000,\"name\":\"Xavier Trey\",\"processed\":true,\"guilty\":true,\"charges\":[{\"fine\":3500,\"mont