(32, 'Exectution at Alta Apts - Orange Gang - Investigative Report', 'Johnthan Bean', '1655320414', '**LSPD Report**\n2022-06-15 14:06:39\n**Reporting Officer** @124 Sargeant Johnthan Bean\n\n**Assisting Officer/s:**\n\n@122, @122, @514, @140\n\n**Location:**\n\n==Alta St Apts==\n\n**Debrief:**\n\n\\\n**@124 J. Bean Statement:**\n\n> @124 was patrolling legion square when he heard audibal shots in the area of Alta St Apts, @124 radiod he was heading over to check it out and @125 and @122 radiod same traffic. Once on scene @124 noticed at least 4 people in orange camo holding up two people in blue outfits. @124 was unable to hear anything being said but the two blue people both had their hands up and looked like they were surrrendering. @125 radiod to attempt to get photos. @124 then attempted to get some photos including one of the suspects leaving the scene in a small vehicle. @122 and @125 with @140 took the downed blue individuals to Pillbox Medical and took there statements while @124 collected evidence.\n\n\\\n', '[{\"type\":\"casing\",\"identifier\":\"10-HnG-70\",\"id\":\"1765\",\"cid\":\"\",\"description\":\"Casing #1\"},{\"type\":\"casing\",\"identifier\":\"48-RiQ-8\",\"id\":\"2822\",\"cid\":\"\",\"description\":\"Casing #2\"},{\"type\":\"casing\",\"identifier\":\"169-kmy-722\",\"id\":\"6870\",\"cid\":\"\",\"description\":\"Casing #3\"},{\"type\":\"casing\",\"identifier\":\"46-RjD-557\",\"id\":\"1142\",\"cid\":\"\",\"description\":\"Casing #4\"},{\"type\":\"casing\",\"identifier\":\"53-Qtx-830\",\"id\":\"6337\",\"cid\":\"\",\"description\":\"Casing #5\"},{\"type\":\"blood\",\"identifier\":\"identifier: DNA-86\",\"id\":\"0400\",\"cid\":\"\",\"description\":\"DNA #1\"},{\"type\":\"blood\",\"identifier\":\"identifier: DNA-159\",\"id\":\"0854\",\"cid\":\"\",\"description\":\"DNA #2\"},{\"type\":\"photo\",\"identifier\":\"https://i.imgur.com/obDCfGR.jpeg\",\"id\":\"1497\",\"cid\":\"\",\"description\":\"Crime Scene #1\"},{\"type\":\"photo\",\"identifier\":\"https: