(33, 'OIS - Legtion Square', 'Johnthan Bean', '1655321704', '**LSPD Report**\n2022-06-15 14:06:70\n**Reporting Officer**\n@124 Officer Johnthan Bean\n**Assisting Officer/s:**\n\n@122, @140 @161 \n**Location:**\n\n==Alta St Apts  Vespucci  Pillbox== \n\n**Debrief:**\n\n\\\n**@124 J. Bean Statement:**\n\n> @140 was patrolling when he noticed a stolen police cruiser, @140 chased the stolen vehicle for 10 minutes before the stolen vic ended at PDM, @122 attempted to chase on foot when the suspects beat @122 down with knuckle dusters and a crowbar. After knocking @122 down the put him in a vehicle and drove off to an alleyway off of elgin and hawick ave. @124 pulled up beside the alleyway and noticed the suspects put the officer outside of the vehicle so @124 warned them then started shooting, @124 downed Carlos Jacobs and Shoob Shavier but another suspect drove off in there black vehicle. @140 was able to catch it on the other side of the alleyway, @140 asked permission to shoot them and @124 granted it. @140 downed the remaining suspect and then set up a triage point in the alleyway. After waiting a few minutes for any other suspects @124 ordered everyone to go to Pillbox to get the suspects medical attention. Once at Pillbox Nancy treated all the suspects for there GSWs and once they were cleared they were all transported to MRPD. @124 proccessed Shoob Shavier and Carlos Jacobs. ==Both individuals were fresh off the plane so @124 did not go too hard on the suspects.== \n\n\\\n', '[{\"type\":\"photo\",\"identifier\":\"https://i.imgur.com/JFfH0mD.png\",\"id\":\"1024\",\"cid\":\"\",\"description\":\"Possesions of LMAR JONES\"},{\"type\":\"photo\",\"identifier\":\"https://i.imgur.com/ME5MX3X.png\",\"id\":\"9318\",\"cid\":\"\",\"description\":\"DNA Swab\"},{\"type\":\"photo\",\"identifier\":\"https://i.imgur.com/X5P0DbT.png\",\"id\":\"0480\",\"cid\":\"\",\"description\":\"Shoob Shavier DNA Swab\"},{\"type\":\"photo\",\"identifier\":\"https://i.imgur.com/IhZWhow.png\",\"id\