(34, 'Manny Gonzalez - Felony Possession with intent to distribute', 'Johnthan Bean', '1655325306', '**LSPD Report** 2022-06-15 14:06:70\n\n**Reporting Officer**\n\n@124 Sargeant Johnthan Bean\n\n**Assisting Officer/s:**\n\n@161\n\n**Location:**\n\n==Vinewood Blvd  FIB  Alleyway off of Vespucci and Power St.==\n\n**Debrief:**\n\n\\\n**@124 J. Bean Statement:**\n\n> @124 was patrolling shortly after tsunami when a 10-99 Suspicious Handoff call was sent by dispatch, @124 headed to the location and noticed the suspect on the scene besides his black beatup vehicle. @124 then approached and questioned the suspect and eventually let him off since @124 had not gained enough PC for an arrest. @124 noticed the suspect leave the scene through some alleyways so @124 waited in an alleyway for 5 minutes. @124 then noticed yet another handoff and decided to head to the location and talk to the suspect. When @124 arricved he noticed it was the same suspect so @124 ordered the suspect  to show him hands and that he was being arrested. The suspect then hopped in his black vheicle and drove off, @124 radiod it in and @161 headed over to assist in the vehicle pursuit, Units chased the vehicle for 15 minutes before the suspect got out of his vehicle at the FIB headquarters in the fountain area, @161 chased on foot while @124 stayed mobile. The suspect and @161 jumped off a roof and @161 went down during the jump so @124 took @161 to Pillbox before returning to the scene and requesting for an impound. While heading to MRPD @124 noticed the suspect in the same clothes running down Elgin Ave, @124 attempted to detain the suspect and the suspect snorted something and started running quickly. @124 radiod it in and chased the suspect until @161 was able to taze and cuff the suspect. @124 then took him to Pillbox where Nancy treated him for tazer prongs and ankle injuries from his fall. @124 then proccessed him and since the suspect was so broke (2900 dollars to his name) agreed to drop a few