(45, 'Kenny Gates - Lamar Wu - Attempted Murder of a LEO', 'Alex Hernandez', '1655417189', '**LSPD Report**\n2022-06-16 18:06:10\n**Reporting Officer**\n@101 Chief Of Police Alex Hernandez\n**Assisting Officer/s:**\n\n**@Bobby Snow**\n\n**@Dude Guy**\n\n**@Miguel Hernandez**\n\n**Suspect/s:**\n\n**@Kenny Gates**\n\n**@Lamar Wu**\n\n**Victim/s:**\n\n**@Miguel Hernandez**\n\n**@Bobby Snow**\n\n**Witnesses:**\n\n**@Alex Hernandez**\n\n**@Dude Guy**\n\n**Location:**\n\n**==Hawick/Alta Street==**\n\n**Debrief:**\n\n@101 Alex Hernandez Statement\n\n> 101 clocked on duty when a 10-13A was hit by Captain Miguel Hernandez. 101 and 160 responded Code-3 and the suspects fled the scene. Casings were found and the Captain was transported to Pillbox to get treated for his GSWs. Shortly after a callout was made that a ride-along noticed a white komoda on scene of the shooting. 5 minutes later we notice that white komoda lurking in the area and attempt to stop the vehicle. Lamar Wu and Kenny gates initiate a 10-80 (Vehicle Pursuit and begin fleeing recklessly around the city. After a 10-50 on Hawick the suspects jump out of their vehicles with weapons in hand and begin to open fire on Officers on scene and Officers responding. Shortly after the shootout between LSPD and the 2 suspects 1 Officer (Bobby Snow 161) goes down. Both suspects were also taken down and placed into police custody. Officers/suspects were transported and 160 (Dude Guy) stayed on scene to collect casings/dna and take pictures of the scene. (White Komoda was impounded $1,500) Suspects weapons linked back to the first shootout at Pillbox and both were found in possession of Police/Government Issued Equipment/Weapons. (Both suspects sent to prison 48 hour hold until DOJ signs/checks the Search Warrant)\n\n\\\n@160 Dude Guy Statement\n\n> Arrived on scene of 105s 10-13a. White in color Komoda was on scene circling the officer that was down in his car. 105 ride along PID the car as the one that shot Officer Miguel. Opened fire on the white Komoda. Car fled the scene. 101 intercepted and started to pursue. Chase continued north on alta and around that general area. While around the corner I heard over the radio gun gun gun and then multiple shots were fired. Approached the scene from the north of Alta and Hawick. Helped to secure the scene.\n\n\\\n', '[{\"id\":\"9349\",\"cid\":\"\",\"description\":\"#1 Scene of Shooting 1/4\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987110806594408478/unknown.png\",\"type\":\"photo\"},{\"id\":\"9793\",\"cid\":\"\",\"description\":\"#1 Scene of Shooting 2/4\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987111025683882044/unknown.png\",\"type\":\"photo\"},{\"id\":\"8020\",\"cid\":\"\",\"description\":\"#2 Scene of Shooting 1/4\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987112777518817290/unknown.png\",\"type\":\"photo\"},{\"id\":\"9052\",\"cid\":\"\",\"description\":\"#2 Scene of Shooting 2/4\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987112894086922310/unknown.png\",\"type\":\"photo\"},{\"id\":\"9005\",\"cid\":\"189\",\"description\":\"Kenny Gates Possessions 1/1\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987112514749870170/unknown.png\",\"type\":\"photo\"},{\"id\":\"9227\",\"cid\":\"191\",\"description\":\"Lamar Wu Possessions 1/1\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987112648590098542/unknown.png\",\"type\":\"photo\"},{\"id\":\"4671\",\"cid\":\"189\",\"description\":\"Kenny Gates\",\"identifier\":\"DNA-189\",\"type\":\"blood\"},{\"id\":\"3378\",\"cid\":\"191\",\"description\":\"Lamar Wu\",\"identifier\":\"DNA-191\",\"type\":\"blood\"},{\"id\":\"9131\",\"cid\":\"237\",\"description\":\"Glock 22\",\"identifier\":\"237-JFF-413\",\"type\":\"weapon\"},{\"id\":\"8278\",\"cid\":\"45\",\"description\":\"Glock 22\",\"identifier\":\"45-foA-862\",\"ty