(47, 'Adam Gray - Gang Related Shooting', 'Alex Hernandez', '1655422249', '**LSPD Report** 2022-06-16 19:06:89 **Reporting Officer** @101 Chief Of Police Alex Hernandez **Assisting Officer/s:**\n\nAlex Hernandez\n\nDude Guy\n\nKyle Langston\n\n**Suspect/s:**\n\n**==Milo Frost - Crip/Blue Gang==**\n\n**==Adam Gray - Crip/Blue Gang==**\n\n**==Samel Williams - Crip/Blue Gang==**\n\n**==Tyler Garcia - Crip/Blue Gang==** \n\n**Witnesses:**\n\nAlex Hernandez\n\nDude Guy\n\nKyle Langston **Location:**\n\n**==@Pill Box==**\n\n**Debrief:**\n\n@101 Alex Hernandez Statement\n\n> Officer 160 Dude Guy was on scene of a Gang Related Shooting between Crips and a unknown gang. After sometime we lost eyes on the shooters and later find them at Pill Box. The suspects refuse to talk to Officers after attempting to detain and GSR and all fled the scene. Milo Frost was in a black 4 door stratum when he flipped off of the bridge and blew up. Milo Frost was then placed into Police Custody. Another vehicle occupied x3 pulls up (Multi-Colored Komoda) and attempted to break Milo Frost out of custody. After a quick interaction all of the Crip Affiliated Gang Members were arrested. All suspects rights were read, treated at Pill Box and transported to MRPD for processing. Suspects plead guilty and were sent off.\n\n\\\n', '[{\"id\":\"1003\",\"cid\":\"265\",\"description\":\"Scene of Gang Related Shooting 1/3\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987130460196995173/unknown.png\",\"type\":\"photo\"},{\"id\":\"8709\",\"cid\":\"265\",\"description\":\"Scene of Gang Related Shooting 2/3\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987130543554592818/unknown.png\",\"type\":\"photo\"},{\"id\":\"0564\",\"cid\":\"265\",\"description\":\"Scene of Gang Related Shooting 3/3\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987130695275151401/unknown.png\",\"type\":\"photo\"},{\"id\":\"0360\",\"cid\":\"265\",\"