(48, 'Tyler Garcia - Shooting at adams apple ammunation', 'Kyle Langston', '1655422275', '**LSPD Report**\n2022-06-17 01:06:02\n**Reporting Officer** @206 Trooper Kyle Langston \n\n**Assisting Officer/s: 101** | A. Hernandez \n\n**Suspect/s:**  Tyler Garcia\n\n**Location:** Started at Adams Apple Ammunation, ended at Pillbox \n\n**Debrief:**\n\n> 206 and 160 responded to shots fired at the Adams Apple amunation store, 206 and 160 waited untill they went to pillbox, than took of. One of the suspects crashed of the bridge at dell perro and exploded in the canals, Mr. Garcia and his friend started circling us but couldnt find a way to get us. When we went to Pillbox they came back and tried to save their friend. We managed to arrest them all\n\n\\\n', '[{\"id\":\"4954\",\"cid\":\"\",\"description\":\"Guy with blue hair in car is Tyler on scene\",\"identifier\":\"https://media.discordapp.net/attachments/983940889334415421/987130695275151401/unknown.png?width=960&height=540\",\"type\":\"photo\"},{\"id\":\"0259\",\"cid\":\"\",\"description\":\"DNA swap\",\"identifier\":\"https://puu.sh/J6h1J/9604f79333.png\",\"type\":\"photo\"},{\"id\":\"6003\",\"cid\":\"\",\"description\":\"GSR test\",\"identifier\":\"https://puu.sh/J6h1A/a24dd5317c.png\",\"type\":\"photo\"},{\"id\":\"2423\",\"cid\":\"\",\"description\":\"His gun\",\"identifier\":\"https://puu.sh/J6hcU/d2b92b8893.jpg\",\"type\":\"photo\"}]', '[{\"cid\":16,\"callsign\":\"101\",\"name\":\"Alex Hernandez\"}]', '[{\"cid\":237,\"name\":\"Dude Guy\"}]', NULL, NULL, '[{\"processed\":true,\"months\":40,\"charges\":[{\"title\":\"Gang Enhancement\",\"months\":15,\"points\":0,\"id\":\"4965\",\"fine\":1200},{\"title\":\"Poss. of Firearm w/o a Weapon Licence\",\"months\":10,\"points\":0,\"id\":\"0552\",\"fine\":1000},{\"title\":\"Negligent Discharge of a Firearm/Weapon in Public\",\"months\":15,\"points\":0,\"id\":\"6492\",\"fine\":1000}],\"warrant\":false,\"cid\":313,\"name\":\"Tyler Garcia\",\"guilty\":true,\"points\":0,\"warrantda