(49, 'Milo Frost - Gang Enhancement', 'Alex Hernandez', '1655422719', '**LSPD Report**\n2022-06-16 19:06:89\n**Reporting Officer**\n@101 Chief Of Police Alex Hernandez\n**Assisting Officer/s:**\n\nAlex Hernandez\n\nDude Guy\n\nKyle Langston\n\n**Suspect/s:**\n\n**==Milo Frost - Crip/Blue Gang==**\n\n**==Adam Gray - Crip/Blue Gang==**\n\n**==Samel Williams - Crip/Blue Gang==**\n\n**==Tyler Garcia - Crip/Blue Gang==**\n**Witnesses:**\n\nAlex Hernandez\n\nDude Guy\n\nKyle Langston\n**Location:**\n\n**==@Pill Box==**\n\n**Debrief:**\n\n@101 Alex Hernandez Statement\n\n> Officer 160 Dude Guy was on scene of a Gang Related Shooting between Crips and a unknown gang. After sometime we lost eyes on the shooters and later find them at Pill Box. The suspects refuse to talk to Officers after attempting to detain and GSR and all fled the scene. Milo Frost was in a black 4 door stratum when he flipped off of the bridge and blew up. Milo Frost was then placed into Police Custody. Another vehicle occupied x3 pulls up (Multi-Colored Komoda) and attempted to break Milo Frost out of custody. After a quick interaction all of the Crip Affiliated Gang Members were arrested. All suspects rights were read, treated at Pill Box and transported to MRPD for processing. Suspects plead guilty and were sent off.\n\n\\\n> Dave Paul Warrant: \n>\n> Illegal Sale/Transfer of Illegal Weapons\n>\n> Active Warrant | EXP 07/16/2022 | Dave Paul had his license revoked and has had 3+ weapons coming back to him on different suspects that we have arrested. Do not process with HC on duty/supervising (Needs to be interrogated)\n\n\\\n> Nick Diaz Warrant: \n>\n> Felonious Tresspassing, Poss Class 1 Wep, Attempted Murder \n>\n> Active Warrant | EXP 07/16/2022 | Nick Diaz posted pictures of himself on Twatter inside Prison with a Class 1 and a downed individual next to him (Refrence Evidence for pictures)\n\n\\\n', '[{\"id\":\"2585\",\"description\":\"Scene of Gang Related Shooting 1/3\",\"type\":\"photo\",\"cid\