(51, 'Midnight Drift - Felony Evading', 'Jimmy Jones', '1655431766', '**LSPD Report**\n2022-06-16 22:06:96\n**Reporting Officer** @252 Sergeant Jimmy Jones \n\n**Assisting Officer/s:**  @160 Dude Guy\n\n**Suspect/s: Midnight Drift**\n\n**Victim/s:** \n\n**Witnesses: Richard Dangle (Ride Along)** \n\n**Location: The Gallery**\n\n**Debrief:**\n\nWhile in a Traffic Stop, @252 Jimmy Jones, and @160 Dude Guy observed an individual speeding up/past us to park at the Gallery. After intiating the traffic stop, I asked Mr. Drift for License, Registration, and Proof of insurance. Directly after he produced the ID of Jonthan Bean  an Officer in the LSPD. There was an attempt made to detain the suspect, but he started his car, and drove off. I found the vehicle pulled over around the corner shortly after. Upon attempting to initiate another traffic stop on Mr. Drift, He sped off and led us on a Low speed chase wit hspeed not reaching over 60MPH. \n\nHis driving was very erratic, and he was swerving all over the road. Shortly after the pursuit started, we had the suspect succesfully stopped using a manuever called a Box. Mr. Drift then acted as if he was going to surrender, and proceeded to get into a police cruiser with a rifle rack. He put the car in reverse, and began driving away with a Ride along in the vehicle. @252 Jimmy Jones, and @160 Dude Guy opened fire upon the suspect with well aimed shots, and the suspect was subdued, and taken to Pill Box Medical to receive medical treatment.\n\n\\\n', 'null', '[{\"cid\":237,\"callsign\":\"160\",\"name\":\"Dude Guy\"}]', '[{\"name\":\"Midnight Drift\",\"cid\":174}]', NULL, NULL, '[{\"processed\":true,\"months\":40,\"charges\":[{\"title\":\"Reckless Driving\",\"months\":10,\"points\":5,\"id\":\"1858\",\"fine\":1500},{\"title\":\"Felony Evading Law Enforcement (Vehicle)\",\"months\":15,\"points\":0,\"id\":\"3161\",\"fine\":2000},{\"title\":\"Poss. Of Stolen Property\",\"months\":15,\"points\":0,\"id\":\"2031\",\"fine\":1000}],\"warrant\":false,\"points\":5,\"cid\":174,\"guilty\":true,\"warrantdate\":0,\"name\":\"Midnight Drift\",\"fine\":4500}]'),
