(55, 'Johnathan M. - Obstruction of Justice', 'Kyle Langston', '1655493841', '**LSPD Report**\n2022-06-17 21:06:28\n**Reporting Officer**\n@206 Trooper Kyle Langston\n**Assisting Officer/s:** 103 | Sam Das\n\n**Suspect/s:** Johnathan Matthews\n\n**Location: Train station behind MRPD**\n\n**Debrief:**\n\n> 103 and 161 were in a chase when Mr. Matthews interfered and tried to ram us. We were driving up and down the Canals behind MRPD when they attempted a jump but failed. Mr Matthews was cuffed and processed at MRPD.\n\n\\\n', 'null', '[{\"cid\":31,\"callsign\":\"103\",\"name\":\"Sam Das\"},{\"cid\":45,\"callsign\":\"161\",\"name\":\"Bobby Snow\"},{\"cid\":193,\"callsign\":\"162\",\"name\":\"Harry Brown\"}]', '[{\"cid\":356,\"name\":\"Johnathan Matthews\"}]', NULL, NULL, '[{\"months\":0,\"points\":0,\"warrantdate\":0,\"name\":\"Johnathan Matthews\",\"fine\":0,\"guilty\":false,\"cid\":356,\"warrant\":false,\"charges\":[],\"processed\":false}]'),
