(58, 'Drug Sales - Dan Herrera', 'Paul Blart', '1655508816', '**LSPD Report**\n2022-06-17 16:06:56\n**Reporting Officer**\n@507 Cadet Paul Blart\n**Assisting Officer/s:**\n\n162 Harry Brown \n\n**Suspect/s:**\n\nTyler Garcia/Dan Herrera \n\n**Victim/s:**\n\nN/A \n\n**Witnesses:**\n\nN/A\n\n**Location:**\n\nVespucci \n\n**Debrief:**\n\n\\\n> I was in the immediate area of a drug handoff call, when I arrived on scene I questioned Mr.Herrera About his business in the area. after speaking to Mr.Herrera for some time I ran the plate on his vehicle, which came but stolen. after breaking the news to Mr.Herrera he started to talk on his radio requesting backup, about 3 minutes later Mr.Garcia arrived on scene and attempted to break out Mr.Herrera\n\n\\\n', '[{\"type\":\"photo\",\"description\":\"Drugs\",\"cid\":\"260\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987501089320472586/Screenshot_900.png\",\"id\":\"9212\"}]', '[{\"cid\":175,\"callsign\":\"507\",\"name\":\"Paul Blart\"},{\"cid\":193,\"callsign\":\"162\",\"name\":\"Harry Brown\"}]', '[{\"cid\":313,\"name\":\"Tyler Garcia\"},{\"cid\":260,\"name\":\"Dan Herrera\"}]', NULL, NULL, '[{\"charges\":[{\"points\":0,\"fine\":1500,\"title\":\"Aiding and Abetting\",\"months\":20,\"id\":\"5529\"},{\"points\":0,\"fine\":1250,\"title\":\"Assault On Public Servant\",\"months\":10,\"id\":\"0913\"}],\"processed\":false,\"guilty\":false,\"cid\":313,\"months\":30,\"warrant\":false,\"points\":0,\"name\":\"Tyler Garcia\",\"fine\":2750,\"warrantdate\":0},{\"charges\":[{\"points\":0,\"fine\":2500,\"title\":\"Drug Trafficking 200 - 350\",\"months\":20,\"id\":\"4021\"}],\"processed\":false,\"guilty\":false,\"cid\":260,\"months\":20,\"warrant\":false,\"points\":0,\"name\":\"Dan Herrera\",\"fine\":2500,\"warrantdate\":0}]'),
(59, 'Jamal Montana  - Drug Sales', 'Bobby Snow', '1655557919', '**LSPD Report**\n2022-06-18 06:06:14\n**Reporting Officer** @105 Officer Bobby Snow\n\n**Assisting Officer/s: N/A**\n\n**Suspect/s:** Jamal Montana\n\n**Victim/s: Locals**\n\n**Witnesses: N/A**\n\n**Location: The Barrio, Jamestown ST**\n\n**Debrief:**\n\n> @105 Snow Responded to suspicious handoffs at Jamestown ST next to the barrio! The only person there was one Jamal Montana wearing all pink with long hair! @105 Snow started talking to Mr. Montana and he was explaining that he was selling newspaper but refused to sell @105 Snow the newspaper. @105 Snow then left the area and went into an ally way. @105 Snow then saw Jamal Montana switched is bag full of Newspaper to some sort of drug bag and started selling to the locals of Jamestown. @105 Snow then took pictures and left the area so he can write the warrent for Mr. Montana!\n\n\\\n', '[{\"identifier\":\"https://i.imgur.com/rfZet8K.jpeg\",\"description\":\"Giving Locals Drugs\",\"type\":\"photo\",\"cid\":\"\",\"id\":\"1582\"},{\"identifier\":\"https://i.imgur.com/t5imKSY.jpeg\",\"description\":\"Giving Locals Drugs 2\",\"type\":\"photo\",\"cid\":\"\",\"id\":\"2032\"}]', '[{\"name\":\"Bobby Snow\",\"cid\":45,\"callsign\":\"161\"}]', '[{\"cid\":61,\"name\":\"Jamal Montana\"}]', NULL, NULL, '[{\"charges\":[{\"fine\":2500,\"points\":0,\"months\":20,\"title\":\"Drug Trafficking 200 - 350\",\"id\":\"6759\"}],\"warrantdate\":0,\"cid\":61,\"fine\":2500,\"points\":0,\"guilty\":false,\"months\":20,\"warrant\":false,\"name\":\"Jamal Montana\",\"processed\":false}]'),
(60, 'Shooting in gang area.', 'Sam Das', '1655568048', '**LSPD Report**\n2022-06-18 16:06:93\n**Reporting Officer**\n@102 Deputy Chief Of Police Sam Das\n**Assisting Officer/s:**\n**Suspect/s:**\n**Victim/s:**\n**Witnesses:**\n**Location:** **Debrief: Myself 101, 111, 105 attened a 71 in the southside upon arriving we get rammed, by them so it leads into a chase. When i thought he was just gonna spin the area and said we should get on the roof and set up a surveillance. Waiting for the car to come back, When we try to get on the roof we instantly get shot at by a gang called MTF. Upon getting shot, Mikey, Frank and Bobby all go down. At this point I am left in an impossible 1 v 4 situation. So I decided to change to my AR so I would have at least a chance. When I got closer I noticed that they left with Mikey and Frank. So I take Bobby to pillbox and get him medical treatment.** ', '[{\"identifier\":\"https://i.imgur.com/1yyOrBj.jpeg\",\"description\":\"Shooting Scene, MRPD 1\",\"type\":\"photo\",\"cid\":\"\",\"id\":\"6740\"},{\"identifier\":\"https://i.imgur.com/qcWnQVu.jpeg\",\"description\":\"Shooting Scene, MRPD 2\",\"type\":\"photo\",\"cid\":\"\",\"id\":\"1813\"},{\"identifier\":\"https://i.imgur.com/sSqxAAN.jpeg\",\"description\":\"Shooting Scene, Shooting at Construction Site 2\",\"type\":\"photo\",\"cid\":\"\",\"id\":\"5119\"},{\"identifier\":\"https://i.imgur.com/m9mslvS.jpeg\",\"description\":\"Shooting Scene, Shooting at Construction Site 2\",\"type\":\"photo\",\"cid\":\"\",\"id\":\"5600\"}]', '[{\"name\":\"Mikey Nakamura\",\"cid\":55,\"callsign\":\"101\"},{\"name\":\"Sam Das\",\"cid\":31,\"callsign\":\"102\"},{\"name\":\"Frank Castle\",\"cid\":69,\"callsign\":\"125\"},{\"name\":\"Bobby Snow\",\"cid\":45,\"callsign\":\"105\"}]', 'null', NULL, NULL, '[{\"charges\":[],\"warrantdate\":0,\"cid\":164,\"processed\":false,\"months\":0,\"guilty\":false,\"name\":\"Tom Lewis\",\"warrant\":false,\"points\":0,\"fine\":0}]'),
(61, 'Tyrone Jacqual - Aiding and Abetting', 'Tito Vito', '1655573759', '**LSPD Report**\n2022-06-18 13:06:70\n**Reporting Officer** @513 Cadet Tito Vito\n\n**Assisting Officer/s:** \n\n**@105 Snow** \n\n**@102 Sam Das** \n\n**@160 Dude Guy** \n\n**@506 Dick Rich**\n\n@164 Paul Blart\n\n@501 AJ Charles\n\n**Suspect/s:** Tyrone Jacqual, Jamal Montana\n\n**Victim/s: N/A**\n\n**Witnesses: N/A**\n\n**Location: Taco Shop, South Side**\n\n**Debrief:**\n\n\\\n> Officer responded to a city wide chase that lasted 5-6 Min, Mr. Montana was brake checking officers and then was boxed at the taco shop near the south side of LS. Officers then arrested Mr. Montana then Mr. Jacqual attepted to free Mr. Montana but was unsuccessful in doing so!\n\n\\\n> During processing Mr. Jacqual and Mr. Montana tricked officers in opening the door and then attacked every officer that was present in the cells. @513 then cuffed @105 and Mr. Jacqual went demon mode and got K.Od by @501 AJ Charles!\n\n\\\n', 'null', '[{\"name\":\"Bobby Snow\",\"callsign\":\"105\",\"cid\":45},{\"name\":\"Sam Das\",\"callsign\":\"102\",\"cid\":31},{\"name\":\"Dude Guy\",\"callsign\":\"160\",\"cid\":237},{\"name\":\"Tito Vito\",\"callsign\":\"513\",\"cid\":109},{\"name\":\"Dick Rich\",\"callsign\":\"506\",\"cid\":282},{\"name\":\"Paul Blart\",\"callsign\":\"164\",\"cid\":175},{\"name\":\"AJ Charles\",\"callsign\":\"501\",\"cid\":96}]', 'null', NULL, NULL, '[{\"charges\":[{\"fine\":1500,\"points\":0,\"months\":20,\"title\":\"Aiding and Abetting\",\"id\":\"7085\"},{\"fine\":1250,\"points\":0,\"months\":10,\"title\":\"Assault On Public Servant\",\"id\":\"4511\"}],\"warrantdate\":0,\"cid\":10,\"fine\":2750,\"name\":\"Tyrone Jacqual\",\"guilty\":false,\"months\":30,\"processed\":true,\"warrant\":false,\"points\":0},{\"charges\":[{\"fine\":1500,\"points\":0,\"months\":20,\"title\":\"Illegal Possession of Class 2 Controlled Substances\",\"id\":\"1957\"}],\"warrantdate\":0,\"cid\":61,\"fine\":1500,\"name\":\"Jamal Montana\",\"g