(62, 'Gang Related Shooting - Tyrone Jackson - 18/06/2022', 'Jack Brown', '1655575091', '**SASP Report** 2022-06-18 18:06:19\n\n**Reporting Officer** @203 Captain Jack Brown \n\n**Assisting Officer/s:**\n\n**\\[160\\] Dude Guy.**\n\n**\\[203\\] Jack Brown.**\n\n**\\[104\\] Jimmy Espinoza.**\n\n**\\[102\\] Sam Das.**\n\n**Location:** Little Seoul.\n\n**Debrief:**\n\nMyself \\[203\\] Jack Brown was responding to a shooting in Little Seoul where there was multiple people in vehicles and around the area. Peoplpe were shooting from roof tops after we waited for the shootout to finish we then moved in and sweapt up all of the dead bodys took them to pillbox and arrested them. Tyrone Jackson was arrested for 1x Gang Related Shooting. \n\n\\\nConfiscated Items:\n\nN/A.', '[{\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987776409680375818/unknown.png\",\"description\":\"Vehicles On Scene.\",\"id\":\"5082\",\"cid\":\"\",\"type\":\"photo\"},{\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987770887275184148/unknown.png\",\"description\":\"Revolter on scene.\",\"id\":\"3518\",\"cid\":\"\",\"type\":\"photo\"}]', '[{\"name\":\"Sam Das\",\"cid\":31,\"callsign\":\"102\"},{\"name\":\"Jack Brown\",\"cid\":29,\"callsign\":\"203\"},{\"name\":\"Dude Guy\",\"cid\":237,\"callsign\":\"160\"},{\"name\":\"Jimmy Espinoza\",\"cid\":9,\"callsign\":\"104\"}]', 'null', NULL, NULL, '[{\"warrant\":false,\"warrantdate\":0,\"cid\":144,\"fine\":3500,\"processed\":false,\"guilty\":true,\"months\":25,\"charges\":[{\"fine\":3500,\"points\":0,\"months\":25,\"title\":\"Gang Related Shooting\",\"id\":\"2370\"}],\"name\":\"Tyrone  Jackson\",\"points\":0}]'),
(63, 'Lennox Booth - Shootout', 'Paul Blart', '1655575125', '**LSPD Report**\n2022-06-18 10:06:37\n**Reporting Officer**\n@164 Cadet Paul Blart\n**Assisting Officer/s:**\n\n101 Mikey N.\n\n206 Kyle L.\n\n**Suspect/s:**\n\nLennox Booth\n\n**Victim/s:**\n\nLSPD\n\n**Witnesses:**\n\nLSPD\n\n**Location:**\n\nSandy Shores\n\n**Debrief:**\n\n\\\n> Mr.Booth was seen leaving the scene of an active gang shootout at excessive speeds, after attempting to initiate a 10-38 he continued to evade and drive very Recklessly. After about 5 mins in the 10-80 Mr.Booth intentionally drove through gang territory and organized a shooting on officers, while still in this vehicle. No officers were injured until he bailed out of his vehicle in sandy shores and downed 1 officer. After searching his vehicle Kyle Langston discovered that he was trafficing a large about of drugs including weed and coke.\n\n\\\n\\\n\\\n', '[{\"identifier\":\"https://puu.sh/J6yBf/bb5d02f79b.jpg\",\"description\":\"Drugs\",\"id\":\"2878\",\"cid\":\"\",\"type\":\"photo\"},{\"identifier\":\"https://puu.sh/J6yBo/d6f68a0d1b.jpg\",\"description\":\"Drugs2\",\"id\":\"1208\",\"cid\":\"\",\"type\":\"photo\"},{\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987779132878356541/gsr_positive.png\",\"description\":\"GSR\",\"id\":\"5701\",\"cid\":\"\",\"type\":\"photo\"},{\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987781767404593222/unknown.png\",\"description\":\"Gun/Drugs/Gov. Equip\",\"id\":\"6883\",\"cid\":\"\",\"type\":\"photo\"},{\"identifier\":\"https://i.imgur.com/R7Feg1v.jpg\",\"description\":\"Scene Casings/Blood/Frags`\",\"id\":\"2156\",\"cid\":\"\",\"type\":\"photo\"},{\"identifier\":\"https://i.imgur.com/PFiwWFA.png\",\"description\":\"Carfront\",\"id\":\"1381\",\"cid\":\"\",\"type\":\"photo\"},{\"identifier\":\"https://i.imgur.com/AlvApC9.jpg\",\"description\":\"Carback\",\"id\":\"9915\",\"cid\":\"\",\"type\":\"photo\"}]', '[{\"name\":\"Mikey Nakamura\",\"c