(64, 'Kemani Lena - Gang Shootout 6/18/2022', 'Dude Guy', '1655575759', '**LSPD Report**\n2022-06-18 14:06:82\n**Reporting Officer**\n@160 Officer Dude Guy\n**Assisting Officer/s:**\n**Suspect/s:**\n**Victim/s:**\n**Witnesses:**\n\n**Location**\n\n* ==Little Seoul Highrise==\n\n**Debrief:**\n\n> Arrived on scene of an active shootout. Waited about 15 mins for the shootout to end. Went to canvas the area with fellow officers. Individual wearing pink fled the scene on foot. Did not pursue as to give aid to the downed individuals on the rooftop. Apprehended two individuals. A Mr Kemani Lena and a Mr Jamie Lunch. Upon searching Mr Lena, I discovered a PD issued Glock belonging to Officer Paul Blart.\n>\n> In Mr Lunchs back pocket, I discovered two bottles of prescription drugs and what appeared to be 2 baggies of pop rocks. I was later able to confirm the pop rocks were in fact meth rocks.\n\n\\\n* Guilty Plea Deal - 40 Months / $6,000 Fine\n\n\\\n', '[{\"identifier\":\"https://media.discordapp.net/attachments/739527437788119067/987783765592014888/unknown.png\",\"description\":\"Kemani Lena Possessions - (1/1\",\"type\":\"photo\",\"cid\":\"143\",\"id\":\"2757\"},{\"identifier\":\"https://media.discordapp.net/attachments/739527437788119067/987779642670850099/unknown.png\",\"description\":\"GSR Results\",\"type\":\"photo\",\"cid\":\"143\",\"id\":\"3069\"},{\"identifier\":\"175-IOJ-992\",\"description\":\"Weapon in question.\",\"type\":\"weapon\",\"cid\":\"\",\"id\":\"4526\"}]', '[{\"name\":\"Paul Blart\",\"cid\":175,\"callsign\":\"164\"},{\"name\":\"Jack Brown\",\"cid\":29,\"callsign\":\"203\"}]', 'null', NULL, NULL, '[{\"points\":0,\"warrantdate\":0,\"cid\":143,\"processed\":true,\"charges\":[{\"fine\":1200,\"points\":0,\"months\":15,\"title\":\"Gang Enhancement\",\"id\":\"8219\"},{\"fine\":3500,\"points\":0,\"months\":25,\"title\":\"Gang Related Shooting\",\"id\":\"1318\"},{\"fine\":2500,\"points\":0,\"months\":20,\"title\":\"Criminal Possession of a Government Issued Firearm\",\"id\":\"2042\"}],\"guilty\":true,\"name\":\"Kemani Lena\",\"warrant\":false,\"fine\":7200,\"months\":60}]'),
