(66, 'Innocence Boulevard Robbery! - Crips', 'Bobby Snow', '1655579318', '* **LSPD Report**\n  2022-06-18 12:06:88\n  **Reporting Officer**\n  @105 Officer Bobby Snow\n  **Assisting Officer/s:**\n\n\n* @105 Bobby Snow\n* @513 Tito Vito\n* @506 Dick Rich\n* @102 Sam Das\n* @103 Brandon Taz\n\n**Suspect/s:**\n\n**Tyler Garcia**\n\nTyrone Jacqual\n\nJamal Montana\n\nSamel Williams\n\n**Victim/s: Criminals Blew Up! +** Hans Omaicok and Lilly G\n\n**Witnesses: N/A**\n\n**Location:** Innocence Boulevard **24/7, El Burro Heights Gas Station**\n\n**Debrief:**\n\n> @105 + Two Cadets arrived on scene at Innocence Boulevard 24/7 when 4 Suspects armed with two hostages, Hans Omaicok and Lilly G were hostage during the store robbery! @513 Tito Vito took negotiations with the criminals and agreed on free passage + No Spikes in exchage for Omaicok and Lilly G.\n\n\\\n> The chase then started heading all over the south side of Los Santos when @513 took coms during the chase! @513 gave good coms but the chase ended when the crips went straight for a gas pump blowing them to pieces! All suspects were taken to Pillbox and searched for everything illegal.\n\n> \\\n> **==All Plead Guilty==**\n\n\\\n\\\n', '[{\"id\":\"7273\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/Dw9snqM.jpeg\",\"type\":\"photo\",\"description\":\"Car Blew Up!\"},{\"id\":\"6805\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/CKnc1JN.png\",\"type\":\"photo\",\"description\":\"GSR Test (Tyler Garcia)\"},{\"id\":\"0470\",\"cid\":\"\",\"identifier\":\"https://i.imgur.com/JQrHNQN.png\",\"type\":\"photo\",\"description\":\"Tyler Garcia Pockets\"}]', '[{\"name\":\"Bobby Snow\",\"cid\":45,\"callsign\":\"105\"},{\"name\":\"Tito Vito\",\"cid\":109,\"callsign\":\"513\"},{\"name\":\"Dick Rich\",\"cid\":282,\"callsign\":\"506\"},{\"name\":\"Sam Das\",\"cid\":31,\"callsign\":\"102\"},{\"name\":\"Brandon Taz\",\"cid\":32,\"callsign\":\"103\"}]', '[{\"cid\":313,\"name\":\"Tyler Garcia\"},{\"cid\":10,\"name\":\"Tyrone Jacq