(68, 'Pink Gang Little Seoul ShootoutClassic!', 'Bobby Snow', '1655585677', '**LSPD Report**2022-06-18 13:06:33\n\n**Reporting Officer:**@105 Officer Bobby Snow\n\n**Assisting Officer/s:**\n\n@103 Brandon Taz\n\n@122 Tyler Blood\n\n@212 Timothy Jenkins\n\n@513 Tito Vito\n\n@502 Alphonzo Emerson\n\n@101 Mikey Nakamura\n\n@506 Dick Rich\n\n@517 Logan Howe\n\n**Suspect/s:**\n\nReggie Hoemen\n\nDark Lue\n\n**Victim/s:**\n\nLos Santos Police Officers\n\n**Witnesses: N/A**\n\n**Location: Little Seoul**\n\n**Debrief:**\n\n> @105 Snow and his two cadets @513 and @506 saw Mr. Reggie Hoemen shoot a local and steal his vehicle. @105 Snow turned on his sirens and told Mr. Hoemen to pull over. Mr. Hoemen did pull over, and @513 Tito Vito then ordered him to show him some ID and turned off his car. Mr. Hoemen then took off, saying he didnt have any ID and a chase started!\n>\n> \\\n> The chase was citywide and was led into Little Seoul when both suspects started climbing the ladder and both started shooting; Dark Lue was then neutralized during the shootout. Next, Reggie Hoemen started shooting officers, taking down most of them but Air-1, piloted by Tyler Blood + Brandon Taz. @212 T. Jenkins and @103 Brandon Taz took down Reggie Hoemen. All officers shot/taken down were escorted to Pillbox Medical to receive medical treatment. As @105 Snow tried to pickup Reggie Hoemen when he dropped 2 IFAK while cuffed and was then taken to MRPD! Reggie had human body parts which officers responded with a raid on Reggies Alta Apartment!\n\n\\\n> **REGGIE HOEMAN RAID RESULTS**\n>\n> \\\n> 4x Ifaks\n>\n> 5x 5g Crack\n>\n> 1x High Qual Scale\n>\n> 12x Small Rolls of notes\n>\n> 4x Baggies\n>\n> 1x Died Bud\n>\n> 1x Severed Leg\n>\n> 1x Suspicious Packages\n\n\\\n', '[{\"type\":\"photo\",\"description\":\"Reggie Pockets\",\"cid\":\"\",\"id\":\"7737\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987823646603096094/unknown.png\"},{\"type\":\"photo\",\"description\":\"IFAK!\",\"cid\":\"\",\"id\":\"8887\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/987823713514844180/unknown.png\"},{\"type\":\"photo\",\"description\":\"Reggie Hoeman Stash 1/1\",\"cid\":\"\",\"id\":\"8124\",\"identifier\":\"https://i.imgur.com/Qj2WTC7.png\"}]', '[{\"callsign\":\"103\",\"cid\":32,\"name\":\"Brandon Taz\"},{\"callsign\":\"105\",\"cid\":45,\"name\":\"Bobby Snow\"},{\"callsign\":\"122\",\"cid\":82,\"name\":\"Tyler Blood\"},{\"callsign\":\"212\",\"cid\":160,\"name\":\"Timothy  Jenkins\"},{\"callsign\":\"513\",\"cid\":109,\"name\":\"Tito Vito\"},{\"callsign\":\"502\",\"cid\":240,\"name\":\"Alphonzo Emerson\"},{\"callsign\":\"101\",\"cid\":55,\"name\":\"Mikey Nakamura\"},{\"callsign\":\"506\",\"cid\":282,\"name\":\"Dick Rich\"},{\"callsign\":\"517\",\"cid\":256,\"name\":\"Logan Howe\"}]', 'null', NULL, NULL, '[{\"name\":\"Reggie Hoemen\",\"points\":0,\"charges\":[{\"id\":\"4200\",\"fine\":3500,\"points\":0,\"months\":30,\"title\":\"Attempted Murder of a Peace Officer\"},{\"id\":\"7087\",\"fine\":3500,\"points\":0,\"months\":30,\"title\":\"Attempted Murder of a Peace Officer\"},{\"id\":\"1135\",\"fine\":3500,\"points\":0,\"months\":30,\"title\":\"Attempted Murder of a Peace Officer\"},{\"id\":\"8823\",\"fine\":1500,\"points\":0,\"months\":15,\"title\":\"Assault w/ Deadly Weapon\"},{\"id\":\"9543\",\"fine\":1500,\"points\":0,\"months\":15,\"title\":\"Assault w/ Deadly Weapon\"},{\"id\":\"3760\",\"fine\":1500,\"points\":0,\"months\":15,\"title\":\"Assault w/ Deadly Weapon\"},{\"id\":\"6207\",\"fine\":1000,\"points\":0,\"months\":10,\"title\":\"Poss. of Firearm w/o a Weapon Licence\"},{\"id\":\"3807\",\"fine\":1500,\"points\":0,\"months\":10,\"title\":\"Grand Theft Auto\"},{\"id\":\"0538\",\"fine\":2000,\"points\":0,\"months\":15,\"title\":\"Kidnapping\"},{\"id\":\"8341\",\"fine\":10000,\"points\":0,\"months\":35,\"title\":\"Torture\"},{\"id\":\"1677\",\"fine\":3500,\"points\":0,\"months\":30,\"title\":\"Attempted Murder of a Peac