(70, 'Howard John - Fleeing/Eluding Law Enforcement', 'Jonah Bautista ', '1655601290', '**LSPD Report**\n2022-06-18 18:06:99\n**Reporting Officer** @508 Cadet Jonah Bautista\n\n**Assisting Officer/s: @212 Timothy Jenkins, @120 Billy King**\n\n**Suspect/s: Howard John**\n\n**Victim/s:**\n**Witnesses:**\n\n**Location: By old scrapyard**\n\n**Debrief: 120, 212, 508 were at MRPD when we got a call of a stolen firetruck down by old scrapyard. When arrived at scene they saw the suspect Howard John fleeing from an officer, they were running around the scrap yard. Howard John was screaming over his radio asking to be picked up. 212 and 508 then chased the suspect into the canals and were tackling and attemting to cuff the individual. Howard john then had a friend try come pick him up when locals started shooting at him and officers. Howard then tried to get in the car but was shot and downed bu the locals, he was then taken to pill and brought back to mrpd to be processed.**', 'null', '[{\"callsign\":\"212\",\"cid\":160,\"name\":\"Timothy  Jenkins\"},{\"callsign\":\"120\",\"cid\":24,\"name\":\"Billy King\"}]', '[{\"cid\":303,\"name\":\"Howard John\"}]', NULL, NULL, '[{\"name\":\"Howard John\",\"points\":0,\"charges\":[{\"id\":\"9531\",\"fine\":1250,\"points\":0,\"months\":10,\"title\":\"Poss. of Stolen Vehicle\"},{\"id\":\"5513\",\"fine\":1500,\"points\":0,\"months\":15,\"title\":\"Fleeing/Eluding Law Enforcement (On Foot)\"}],\"guilty\":true,\"warrantdate\":0,\"cid\":303,\"warrant\":false,\"processed\":true,\"months\":25,\"fine\":2750}]'),
