(73, 'Crips + More - Drug Trafficking (Case File)', 'Bobby Snow', '1655647861', '**LSPD Report**\n2022-06-19 07:06:89\n**Reporting Officer** @105 Officer Bobby Snow\n\n**Assisting Officer/s:**\n\n**@102 Sam Das**\n\n**Suspect/s:**\n\nJamal Montana\n\nDemarcus Terrence\n\n**Victim/s: N/A**\n\n**Witnesses:** @105 Sam Das\n\n**Location: Alta Street Apartments, LSIA Los Santo Customs**\n\n**Debrief:**\n\n> **Jamal Montana**\n>\n> **@105 Snow + @102 Das went undercover to investigate the meth in Los Santos; both Undercover officers went to Alta Street Apartments when we saw Jamal Montana + Crips. One Crip Member had one large bag of meth on his back, and Mr. Montana had meth on him, which @105 Snow attempted to purchase. @105 Snow or Joseph Ryder gave Mr. Montana $1000 for 5 small bags of meth. Mr. Montana then started chatting with both undercover officers, Im the cook & I can supply you with as much as you want @105 Snow then said he is going to open a nightclub and he needs $20K worth of Meth which Mr. Montana agreed on.**\n\n\\\n> **Mr. Montana gave us x5 Meth bags**\n\n\\\n> **Demarcus Terrence**\n>\n> **@105 + @102 were in a sultan when we spotted Mr. Terrence, We gave him a ride, and he told us to go to The Los Santos Customs near LSIA. We arrived at the spot, and Mr. Terrence showed us the WiFi sign with Small Supply Crate + Mr. Terrence gave us one hit where a Meth Lab is located, Near Forum Drive.**\n\n\\\n> **Gave both @105 +@102 x1 Meth Bag**\n\n\\\n', '[{\"id\":\"7082\",\"identifier\":\"https://i.imgur.com/1vmPdVx.png\",\"cid\":\"\",\"type\":\"photo\",\"description\":\"Small Bags Mr. Montana gave @105\"},{\"id\":\"6553\",\"identifier\":\"https://i.imgur.com/TFCLbqD.png\",\"cid\":\"\",\"type\":\"photo\",\"description\":\"\\\"Small Supply Crate\\\" Location Mr. Terrence gave\"},{\"id\":\"1597\",\"identifier\":\"https://i.imgur.com/ZsMjStE.png\",\"cid\":\"\",\"type\":\"photo\",\"description\":\"\\\"Small Supply Crate\\\" On Phone\"},{\"id\":\"2248\",\"identifier\":\"https://i.imgur.com/5SQlvAI.png\",\"cid\":\"\",\"type\":\"photo\",\"description\":\"Hint for \\\"The Meth Lab\\\" Mr. Terrence gave us\"},{\"id\":\"9597\",\"identifier\":\"https://i.imgur.com/PjJf8Dq.png\",\"cid\":\"\",\"type\":\"photo\",\"description\":\"Crips Sell Spot\"}]', '[{\"cid\":31,\"name\":\"Sam Das\",\"callsign\":\"102\"},{\"cid\":45,\"name\":\"Bobby Snow\",\"callsign\":\"105\"}]', '[{\"cid\":61,\"name\":\"Jamal Montana\"},{\"cid\":26,\"name\":\"Demarcus Terrence\"}]', NULL, NULL, '[{\"processed\":false,\"warrantdate\":\"1658690238\",\"guilty\":false,\"points\":0,\"fine\":5000,\"name\":\"Jamal Montana\",\"cid\":61,\"warrant\":true,\"months\":999999,\"charges\":[{\"id\":\"5026\",\"fine\":5000,\"title\":\"Drug Trafficking 600+\",\"months\":999999,\"points\":0}]},{\"processed\":false,\"warrantdate\":0,\"guilty\":false,\"points\":5,\"fine\":8000,\"name\":\"Demarcus Terrence\",\"cid\":26,\"warrant\":false,\"months\":1000019,\"charges\":[{\"id\":\"8299\",\"fine\":5000,\"title\":\"Drug Trafficking 600+\",\"months\":999999,\"points\":0},{\"id\":\"2345\",\"fine\":1500,\"title\":\"Grand Theft Auto\",\"months\":10,\"points\":0},{\"id\":\"0423\",\"fine\":1500,\"title\":\"Reckless Driving\",\"months\":10,\"points\":5}]}]'),
(74, 'Store Robbery - Clinton Ave', 'Bobby Snow', '1655654033', '* **LSPD Report**\n  2022-06-19 08:06:48\n  **Reporting Officer**\n  @105 Officer Bobby Snow\n  **Assisting Officer/s:**\n\n\n* @102 Sam Das\n* @101 Mikey Nakamura\n* @507 Kay Shiesty\n* @165 Simon Riley\n* @123 Alex Brooks\n\n**Suspect/s:** Milo Frost + DeQuavion Robinson\n\n**Victim/s: N/A**\n\n**Witnesses: N/A**\n\n**Location: Clinton Ave, Alta Street Apartments**\n\n**Debrief:**\n\n> **Officers responded to a store robbery at Clinton Ave! 2 people dressed in blue with Blue Bandanas were robbing the store armed with a hostage, and the officers negotiated for the Los Santos Special + Clean Chase! A chase started and it went city wide! Officers chased the muscle car at La Peruta Freeway near red garage when the vehicle flipped! Both men then started running down the freeway when a blue Jugular picked one of the men up. The other guy when into a stratum and another chase started**\n\n\\\n> **The Stratum was going all around the Rockford Area and Officers lost eyes near Lifeinvader! @101 Mikey Nakamura found them at LSIA and send it near a jump and KABOOM!**\n\n\\\n', 'null', '[{\"name\":\"Bobby Snow\",\"cid\":45,\"callsign\":\"105\"},{\"name\":\"Sam Das\",\"cid\":31,\"callsign\":\"102\"},{\"name\":\"Mikey Nakamura\",\"cid\":55,\"callsign\":\"101\"},{\"name\":\"Kay Shiesty\",\"cid\":328,\"callsign\":\"507\"},{\"name\":\"Simon Riley\",\"cid\":409,\"callsign\":\"165\"},{\"name\":\"Alex Brooks\",\"cid\":71,\"callsign\":\"123\"}]', 'null', NULL, NULL, '[{\"warrant\":false,\"fine\":1750,\"points\":0,\"guilty\":true,\"name\":\"Milo Frost\",\"warrantdate\":0,\"charges\":[{\"fine\":1000,\"months\":10,\"title\":\"Poss. of Firearm w/o a Weapon Licence\",\"points\":0,\"id\":\"3215\"},{\"fine\":750,\"months\":10,\"title\":\"Poss. of Illegal Contraband\",\"points\":0,\"id\":\"9807\"}],\"cid\":257,\"months\":20,\"processed\":true},{\"warrant\":false,\"fine\":4000,\"points\":5,\"guilty\":true,\"name\":\"DeQuavion Robinson\",\"warrantdate\":0,\"charges\":[{\"fine\":1000,\"months\":10,\"title\":\"Poss. of Firearm w/o a Weapon Licence\",\"points\":0,\"id\":\"1826\"},{\"fine\":1500,\"months\":10,\"title\":\"Reckless Driving\",\"points\":5,\"id\":\"9605\"},{\"fine\":1500,\"months\":10,\"title\":\"Grand Theft Auto\",\"points\":0,\"id\":\"8633\"}],\"cid\":25,\"months\":30,\"processed\":true}]'),
(75, 'LMAR Jones - assualt on an LEO -Possesion firearm without license', 'Kay Shiesty', '1655663370', '**LSPD Report**\n2022-06-19 20:06:48\n**Reporting Officer** @507 Cadet Kay Shiesty\n\n**Assisting Officer/s: @530 pito vito**\n\n**Suspect/s: Lmar Jones**\n\n**Victim/s:**\n\nKay Shiesty\n\n**Witnesses: @513 Pito Vito**\n\n**Location: Front desk of mrpd**\n\n**Debrief:**\n\nI cadet shiesty was going through the lobby then was assualted by mister jones who was wilding out in the lobby and then punched me then his rights were read and was charged with assualt of an LEO. after he was cuffed mister jones was found with a firearm that was taken away from him on scene.', 'null', '[{\"cid\":109,\"name\":\"Tito Vito\",\"callsign\":\"513\"}]', 'null', NULL, NULL, '[{\"warrant\":false,\"fine\":2500,\"points\":0,\"guilty\":true,\"name\":\"LMAR JONES\",\"warrantdate\":0,\"months\":25,\"cid\":53,\"charges\":[{\"fine\":1500,\"points\":0,\"title\":\"Assault\",\"months\":15,\"id\":\"1777\"},{\"fine\":1000,\"points\":0,\"title\":\"Poss. of Firearm w/o a Weapon Licence\",\"months\":10,\"id\":\"9410\"}],\"processed\":true}]'),
