(78, 'Jasper Brown - Assult with a Deadly Weapon 06/19/22', 'Alphonzo Emerson', '1655674137', '**LSPD Report**\n2022-06-19 14:06:06\n**Reporting Officer**\n@502 Cadet Alphonzo Emerson\n**Assisting Officer/s:**\n\n@501 AJ Charles\n\n**Suspect/s:**\n\nJasper Brown \n\n**Victim/s:**\n\nAlphonzo Emerson \n\n**Witnesses:**\n\nAJ Charles\n\n**Location:**\n\nSwiss Street\n\n**Debrief:**\n\nAJ Charles got pulled over by Jasper Brown. Cadet Emerson pulled up behind them. They went through with the traffic stop. When AJ and Alphonzo were talking to Jasper he pulled out his crowbar and rushed twards the officers. Alphonzo pulled his service weapon. Jasper rushed Alphonzo which resulted in him firing his pistol. ', '[{\"id\":\"3320\",\"type\":\"photo\",\"identifier\":\"https://i.imgur.com/8TmwXBt.jpg\",\"cid\":\"\",\"description\":\"Scene Photo 1/1\"}]', '[{\"name\":\"AJ Charles\",\"cid\":96,\"callsign\":\"501\"},{\"name\":\"Alphonzo Emerson\",\"cid\":240,\"callsign\":\"502\"}]', '[{\"cid\":299,\"name\":\"Jasper Brown\"}]', NULL, NULL, '[{\"warrant\":false,\"processed\":true,\"fine\":1500,\"guilty\":true,\"warrantdate\":0,\"months\":15,\"points\":0,\"name\":\"Jasper Brown\",\"cid\":299,\"charges\":[{\"title\":\"Assault w/ Deadly Weapon\",\"id\":\"9890\",\"points\":0,\"months\":15,\"fine\":1500}]}]'),
