(80, 'John Bottichio Attempted Murder of Govt Employee', 'Alex Brooks', '1655686644', '**LSPD Report**\n2022-06-19 20:06:97\n**Reporting Officer** @123 Sergeant Alex Brooks\n\n**Assisting Officer/s: N/A**\n\n**Suspect/s: John Bottichio**\n\n**Victim/s:**\n**Witnesses:**\n**Location:** Alta Street Apartments\n\n**Debrief:**\n\n@123 - @123 was on patrol around Alta St Apartments when he got a vehicle theft call infront of the Apartments. @123 was able to get pictures of the suspects tampering with a white in color Buffalo. As they took off @123 pulled them over and conducted a traffic stop when they took off, @123 took after them in hot pursuit, the pursuit started Eastbound on Vespucci Blvd just North of the Apartments. The pursuit continued towards legion square when @123 was rammed from behind by a black in color two door sports car. @123 was able to fight off the sports car and continue the pursuit on the white Buffalo for about 15 minutes. Until after the 6th 100+mph ram from the black sports car the suspect was able to get @123 to lose visual on the Buffalo and they got away.. or so they thought. @123 got another vehicle theft call for a yellow Buffalo. When responding @123 saw it was the same people from the white Buffalo. Around 5 minutes into the pursuit the black sports vehicle returned and continued to ram at 100+mph. @123 was able to contact the individuals in the yellow Buffalo and they stated they did not know the suspect and he was not involved with them in any way. This is when @123 focused on the black sports car and was able to pit and solo box the suspect. Upon @123 exiting his vehicle the suspect attempted to run @123 over with his vehicle, @123 was able to jump on his vehicle out of the way and gun the suspect down. @123 brought the suspect to Pillbox for medical treatment and MRPD for processing.', '[{\"id\":\"7750\",\"description\":\"Original white Buffalo being tampered with\",\"identifier\":\"https://cdn.discordapp.com/attachments/983940889334415421/988258476344115300/20220619203200_1.jpg\",\"cid\":\"\",\"type\":\"photo\"}]', '[{\"name\":\"Alex Brooks\",\"cid\":71,\"callsign\":\"123\"}]', '[{\"cid\":318,\"name\":\"John Bottichio\"}]', NULL, NULL, '[{\"warrant\":false,\"processed\":true,\"fine\":8500,\"guilty\":true,\"warrantdate\":0,\"months\":65,\"points\":5,\"name\":\"John Bottichio\",\"cid\":318,\"charges\":[{\"title\":\"Attempted Murder of a Peace Officer\",\"id\":\"7382\",\"points\":0,\"months\":30,\"fine\":3500},{\"title\":\"Grand Theft Auto\",\"id\":\"6581\",\"points\":0,\"months\":10,\"fine\":1500},{\"title\":\"Reckless Driving\",\"id\":\"6564\",\"points\":5,\"months\":10,\"fine\":1500},{\"title\":\"Felony Evading Law Enforcement (Vehicle)\",\"id\":\"7373\",\"points\":0,\"months\":15,\"fine\":2000}]}]'),
(81, 'Demarcus Terrence - Attempted Murder + More', 'Bobby Snow', '1655729771', '> **LSPD Report**\n>\n> **2022-06-20 05:06:09**\n>\n> **Reporting Officer:** @105 Officer Bobby Snow\n>\n> **Assisting Officer/s:** @103 Brandon Taz\n>\n> **Suspect/s:** Demarcus Terrence\n>\n> **Victim/s:** @105 Bobby Snow\n>\n> **Witnesses:** @103 Brandon Taz\n>\n> **Location:** Alta Street Construction Site + Pillbox\n\n**Debrief:**\n\n> @105 Bobby Snow + @103 Brandon Taz were patroling near Alta Street Apartments when Mr. Terrence started opening fire on our Ford Explorer on top of the construction site next to Alta Street Apartments!\n\n\\\n> @105 Snow then spots Mr. Terrence on the roof of the construction site and makes his way towards it. Mr. Terrence then walks down the construction, and @105 Snow opens fire on Mr. Terrence, killing him on the spot. After Mr. Terrence was GSR tested and Searched, he said, It was the demon man, He told me to shoot the tires! @105 and @103 responded by looking around the area and using their Glock 22s flashlights.\n\n\\\n> Mr. Terrence was then transported to Pillbox, but suddenly Mr. Terrence rose from the dead, and the \"Demon\" started talking. Both officers were scared and took Mr. Terrence to Pillbox! After that, Mr. Terrence told @105 Snow, \"The demons are after him!\" after Mr. Terrence took Nancy, @105 Snow was taken over by the demon and doesn\'t remember what happened! After @105, Snow woke up. Mr. Terrence was gone!\n\n\\\n', '[{\"identifier\":\"https://i.imgur.com/PtCGQI5.png\",\"id\":\"3965\",\"type\":\"photo\",\"description\":\"GSR Test\",\"cid\":\"\"},{\"identifier\":\"https://i.imgur.com/7ovhyg5.png\",\"id\":\"6013\",\"type\":\"photo\",\"description\":\"Mr. Terrence Upper Pockets\",\"cid\":\"\"},{\"identifier\":\"https://i.imgur.com/JCOvGGQ.png\",\"id\":\"0728\",\"type\":\"photo\",\"description\":\"Mr. Terrence Lower Pockets\",\"cid\":\"\"},{\"identifier\":\"https://i.imgur.com/NwVAfQQ.jpeg\",\"id\":\"2669\",\"type\":\"photo\",\"description\":\"Picture Of Scene where Mr. Terrence was killed\",\"cid\":\"\"},{\"identifier\":\"https://i.imgur.com/bnPuRWq.jpeg\",\"id\":\"2558\",\"type\":\"photo\",\"description\":\"scene of shooting\",\"cid\":\"\"},{\"identifier\":\"eType: casing | identifier: 224-BhS-136 | other: -1075685676\",\"id\":\"7644\",\"type\":\"casing\",\"description\":\"casing at scene of the shooting \",\"cid\":\"\"}]', '[{\"name\":\"Bobby Snow\",\"callsign\":\"105\",\"cid\":45},{\"name\":\"Brandon Taz\",\"callsign\":\"103\",\"cid\":32}]', '[{\"name\":\"Demarcus Terrence\",\"cid\":26}]', NULL, NULL, '[{\"points\":0,\"guilty\":false,\"warrantdate\":\"1658325139\",\"warrant\":true,\"cid\":26,\"fine\":7500,\"name\":\"Demarcus Terrence\",\"processed\":false,\"months\":75,\"charges\":[{\"points\":0,\"months\":20,\"title\":\"Illegal Possession of Class 2 Controlled Substances\",\"fine\":1500,\"id\":\"7425\"},{\"points\":0,\"months\":30,\"title\":\"Attempted Murder of a Peace Officer\",\"fine\":3500,\"id\":\"3275\"},{\"points\":0,\"months\":15,\"title\":\"Assault w/ Deadly Weapon\",\"fine\":1500,\"id\":\"4590\"},{\"points\":0,\"months\":10,\"title\":\"Poss. of Firearm w/o a Weapon Licence\",\"fine\":1000,\"id\":\"0996\"}]}]'),
(82, 'bob Valentino - Attempted Murder of Govt Employee ', 'Kay Shiesty', '1655742673', '**LSPD Report** \n\n2022-06-20 19:54:07 \n\n**Reporting Officer** 514 l Cooper Buckweed\n\n**Assisting Officer/s:** 165 l Simon Riley, 507 l Kay Shiesty\n\n**Suspect/s:** bob Valentino\n\n**Victim/s:** **Witnesses:** **Location:** MRPD\n\n**Debrief:**\n\n507, 514 and 165 were in a 10-80 when we caught the original suspect, we were opened fire upon. When we escaped the shooters and took the original suspect to MRPD to safety 514 and 165 were opened fire upon by bob Valentino again, 514 and 165 successfully shot down the dangerous suspect and got him in custody. We were fired upon once again by other suspects which we unfortunately couldnt catch because of the lack of officers we had then on duty. We arrested bob Valentino and charged him with an attempt murder of a peace officer. Suspect pleaded guilty and got charged half the fine and half the time, 15 months, 1.600 $ fine.', 'null', '[{\"callsign\":\"507\",\"cid\":328,\"name\":\"Kay Shiesty\"},{\"callsign\":\"165\",\"cid\":409,\"name\":\"Simon Riley\"},{\"callsign\":\"514\",\"cid\":280,\"name\":\"Cooper Buckweed\"}]', '[{\"name\":\"bob Valentino\",\"cid\":224}]', NULL, NULL, '[{\"points\":0,\"guilty\":true,\"warrantdate\":0,\"charges\":[{\"points\":0,\"fine\":3500,\"title\":\"Attempted Murder of a Peace Officer\",\"months\":30,\"id\":\"8982\"}],\"cid\":224,\"months\":30,\"name\":\"bob Valentino\",\"processed\":true,\"warrant\":false,\"fine\":3500},{\"points\":0,\"guilty\":true,\"warrantdate\":0,\"charges\":[{\"points\":0,\"fine\":1500,\"title\":\"Grand Theft Auto\",\"months\":10,\"id\":\"4245\"},{\"points\":0,\"fine\":1500,\"title\":\"Fleeing/Eluding Law Enforcement (On Foot)\",\"months\":15,\"id\":\"1144\"},{\"points\":0,\"fine\":1000,\"title\":\"Poss. of Firearm w/o a Weapon Licence\",\"months\":10,\"id\":\"7311\"},{\"points\":0,\"fine\":1500,\"title\":\"Illegal Possession of Class 2 Controlled Substances\",\"months\":20,\"id\":\"0874\"},{\"points\":0,\"fine\":1500,\"title\":\"Criminal Possession of Government Issued Equipment\",\"months\":15,\"id\":\"6526\"}],\"cid\":162,\"months\":70,\"name\":\"Dark Lue\",\"processed\":true,\"warrant\":false,\"fine\":7000}]');
