(1, 'Lennox Booth / / GSW + Water in lungs / / 06.12 [NANCY]', 'Lennox Booth', '1655230777', 'Submitted to ICU?: NO\n\nIncident Report:  Lennox Booth was brought into the ER \n\nunconscious by local paramedics. Upon arrival, I was immediately able to visibly see that the top of his head was completely scalped. The  \\\\n origin of these injuries is unknown.\n\nList of Injuries: Scalped head; 4 GSWS to the upper back area; Water in lungs\n\nSurgical Report:\n\n* 2 out of  4 bullets had to be surgically removed.\n* All GSWS were sutured.\n* Head had to be disinfected and wrapped in gauze + skin tissue had to be taken from his thigh to be surgically implanted on his head. (hair growth non recoverable)\n* Anemia Due to Excessive Bleeding\n* Lungs had to be pumped due to **excessive** amounts of water  recovery rate 100%\n\nMedications Applied\n\n* 6mg of Morphine\n* Perscription 10x Aspirin\n\nNotes: The origin of these injuries as stated are unknown. From a medical perspective, the individual was scalped first and then shot and potentially dumped. The order of injury could be determined due to my professional opinion', 'null', '[{\"name\":\"Lennox Booth\",\"cid\":48}]'),
(2, 'Deric James', 'Jimmy Hopkins', '1655400905', '\\#309 Deric James has a headache after being hit KO  is able to get some aspirin (15 bottels) ready to pick up at Pillbox', '[{\"callsign\":\"M1\",\"cid\":141,\"name\":\"Jimmy Hopkins\"}]', 'null');
